(2, 43, 'Individual Seller', 'The Style Collective', "Your one-stop shop for all things fashion. We offer a wide range of styles to suit every taste and budget, from trendy to classic. Whether you're looking for a new outfit for a special occasion or just want to update your everyday wardrobe, we've got you covered.", '/images/SellerLogo/thestylecollective.png', 'UOB', '7303453769', '191A RIVERVALE DR, #08-494, Singapore 581850', 3),
(3, 44, 'Individual Seller', 'Beauty Haven', "We believe that everyone deserves to feel beautiful, and our clothes are designed to help you do just that. We offer a wide range of flattering and stylish clothing in all sizes, so you can find the perfect outfit to make you feel confident and gorgeous.", '/images/SellerLogo/beautyhaven.png', 'Citibank', '8438707149', '138 BEDOK NTH ST 2, #04-376, Singapore 988267', 6),
(4, 45, 'Individual Seller', 'Fashionista', "We're your go-to for all the latest fashion trends. We offer a wide range of stylish and affordable clothing, so you can always look your best without breaking the bank.", '/images/SellerLogo/fashionista.png', 'CIMB', '9798330637', '427 ANG MO KIO AVE 3, #06-186, Singapore 809145', 9),
(5, 46, 'Individual Seller', 'Trendsetter', "We're always ahead of the curve when it comes to fashion. We offer a wide range of cutting-edge clothing that will help you stand out from the crowd.", '/images/SellerLogo/trendsetter.png', 'Bank of China', '6078731201', '509 CHOA CHU KANG ST 51, #04-452, Singapore 853765', 2),
(6, 47, 'Individual Seller', 'My Style, My Way', "We believe that your personal style is unique and special. That's why we offer a wide range of clothing in different styles, so you can find the perfect look to express yourself.", '/images/SellerLogo/mystyle,myway.png', 'Bank of China', '4174593572', '120 MCNAIR RD, #04-300, Singapore 307484', 6),
(7, 48, 'Individual Seller', 'That Fashion Store', "We're your one-stop shop for all things affordable fashion. We offer a wide range of stylish and affordable clothing, so you can always look your best without breaking the bank.", '/images/SellerLogo/thatfashionstore.png', 'DBS', '4065793282', '311C CLEMENTI AVE 4, #02-101, Singapore 466077', 5),
(8, 49, 'Individual Seller', 'Garment Galore', "We're your go-to for all things clothes. We offer a wide range of clothing in all styles and sizes, so you can find the perfect outfit for any occasion.", '/images/SellerLogo/garmentgalore.png', 'RHB', '6732487253', '514 BEDOK NTH AVE 2, #09-369, Singapore 117577', 8),
(9, 50, 'Individual Seller', 'Dress to Impress', "We believe that first impressions are important, and our clothes are designed to help you make the best one possible. We offer a wide range of professional and stylish clothing that will help you look your best at work or any other formal event.", '/images/SellerLogo/dresstoimpress.png', 'DBS', '1274300980', '37 TELOK BLANGAH RISE, #07-347, Singapore 749916', 5),
(10, 51, 'Individual Seller', 'Fashion Fix', "We're your one-stop shop for all things fashion. We offer a wide range of stylish and affordable clothing, so you can always look your best without breaking the bank.", '/images/SellerLogo/fashionfix.png', 'OCBC', '5827232264', '305B ANCHORVALE LINK, #02-438, Singapore 850052', 7),
(11, 52, 'Individual Seller', 'Unique Styles', "We're your go-to for all things unique fashion. We offer a wide range of stylish and affordable clothing that is sure to help you stand out from the crowd.", '/images/SellerLogo/uniquestyles.png', 'Maybank', '2624073863', '241 BT BATOK EAST AVE 5, #08-330, Singapore 340140', 9),
(12, 53, 'Business Seller', 'SHEIN', "Shop the latest fashion trends at SHEIN, your one-stop shop for affordable and stylish clothing. We offer a wide range of styles for women, men, and kids, so you can find the perfect outfit for any occasion.", '/images/SellerLogo/shein.png', 'DBS', '1435941717', '78 Shenton Wy, Level 1 Collection Point, Singapore 079120', 9),
(13, 54, 'Business Seller', 'VANS', "Vans is your go-to destination for iconic skate shoes, apparel, and accessories. We offer a wide range of styles for men, women, and kids, so you can find the perfect look to express your individuality.", '/images/SellerLogo/vans.png', 'CIMB', '9402545608', '18 Robinson Rd, Level 1 Collection Point, Singapore 048547', 10),
(14, 55, 'Business Seller', 'Adidas', "Adidas is a global leader in sportswear and apparel. We offer a wide range of products for athletes and fitness enthusiasts of all levels, as well as stylish and comfortable clothing for everyday wear.", '/images/SellerLogo/adidas.png', 'RHB', '6306149880', '600 North Bridge Rd, Level 1 Collection Point, Singapore 188778', 9),
(15, 56, 'Business Seller', 'Nike', "Nike is a global leader in athletic shoes, apparel, and equipment. We offer a wide range of products for athletes and fitness enthusiasts of all levels, as well as stylish and comfortable clothing for everyday wear.", '/images/SellerLogo/nike.png', 'Maybank', '3857548630', '250 North Bridge Road, Level 1 Collection Point, Singapore 179101', 5),
