(17, 58, 'Business Seller', 'H&M', "H&M is a global leader in affordable fashion. We offer a wide range of stylish and affordable clothing for men, women, and kids. We also have a wide range of home goods, so you can shop for your entire home at H&M.", '/images/SellerLogo/handm.png', 'OCBC', '9627633720', '10 Anson Rd, Level 1 Collection Point, Singapore 079903', 6),
(18, 59, 'Business Seller', 'Cotton On', "Cotton On is a global leader in casual fashion. We offer a wide range of stylish and affordable clothing for men, women, and kids. We also have a wide range of accessories, so you can complete your look with Cotton On.", '/images/SellerLogo/cottonon.png', 'Bank of China', '1870937854', '1 Wallich St, Level 1 Collection Point, Singapore 078881', 10),
(19, 60, 'Business Seller', 'Uniqlo', "Uniqlo is a global leader in life wear. We offer a wide range of stylish and comfortable clothing for men, women, and kids. We also have a wide range of accessories, so you can complete your look with Uniqlo.", '/images/SellerLogo/uniqlo.png', 'OCBC', '9543882274', '1 Raffles Pl, Level 1 Collection Point, Singapore 048616', 11),
