INSERT INTO Items (item_id, seller_id, item_name, category_id, price, description, item_image_path) VALUES 
(4, 18, "Haven Short", 7, 30, "Using Responsibly Sourced Viscose Relaxed summer short Elastic weight with draw cord Lightweight fabric Retro tipping Match back with Haven Short Sleeve Shirt Main 55% Linen (Flax), 45% Viscose (Viscose Rayon). Product Code 2057390-02", "/images/item_images/haven_short.jpg"),
(5, 7, "Pink Platform Sandals", 9, 16, " A flirty and feminine footwear option, these pink platform sandals are sure to add a touch of glamour to any outfit. The elevated platform provides both height and style, while the delicate pink hue is both eye-catching and versatile. Whether you're pairing them with a dress for a special occasion or shorts for a casual day out, these sandals are sure to turn heads.", "/images/item_images/pink_platform_sandals.jpg"),
(6, 3, "Vanta Black Watch", 4, 21, " A truly unique and eye-catching timepiece, the Vanta Black Watch features a dial made from Vantablack, the blackest material known to man. Vantablack absorbs 99.965% of light, giving the dial a deep and mysterious appearance. The watch is powered by a high-quality Swiss movement and is available in a variety of styles.", "/images/item_images/vanta_black_watch.jpg"),
(7, 15, "Tech Fleece Windrunner Men'S Full-Zip Hoodie", 5, 189, "Blending 2 of our most iconic looks, this full-zip hoodie draws design inspiration from our timeless Windrunner jacket, as well as our Tech Fleece jacket. It's designed to feel relaxed through the shoulders, chest and body for an athletic fit you can layer. Our premium, smooth-on-both-sides fleece feels warmer and softer than ever while keeping the same lightweight build you love.", "/images/item_images/Tech_Fleece_Windrunner_Men's_Full-Zip_Hoodie.jpg"),
(8, 17, "Walking Boots", 3, 130, "Boots in hardwearing, water-repellent material suitable for harsh weather conditions. Ankle-height shaft with a padded top edge and a loop at the back, a tongue with a loop and lacing at the front with speed hooks at the top. Reflective details. Mesh linings and insoles. Chunky soles that are patterned underneath. Height of soles 6.5 cm. Article number 1096161001 Heel Height No heel Footwear Style Sneaker boots Functions Water-repellent Description Black, Solid colour", "/images/item_images/walking_boots.jpg"),
(9, 17, "Frilled Tulle To", 6, 140, "Studio Collection. Elegant sleeveless top in a pleated weave with a frilled collar in multiple layers and a small frill trim around the armholes that harmonise perfectly with the delicate, lash-stitch edges. Concealed zip and hook-and-eye fastener at the back of the neck. Unlined. Article number 1191635001 Length Regular length Sleeve Length Short sleeve Fit Regular fit Collar Frilled collar Sleeve Style Flutter sleeve Description Midnight black, Solid colour Collection H&M Studio Collection", "/images/item_images/Frilled_tulle_top.jpg"),
(10, 14, "Adidas Zne Tee Grey", 1, 59, "KEEP YOUR MIND IN BALANCE. Bring it back to the basics with this premium tee from the adidas Z.N.E. series — a collection inspired by the present moment. Moisture-absorbing AEROREADY and an all-cotton build ensure all-day comfort and a calm mindset. Zero negative energy? Always possible. We partner with Better Cotton to improve Cotton farming globally. Better Cotton makes global cotton production better for the people who produce it, better for the environment it grows in, and better for the sector's future. Better Cotton is sourced via a chain-of-custody model called mass balance. This means that Better Cotton is not physically traceable to end products. However, Better Cotton Farmers benefit from the demand for Better Cotton in equivalent volumes to those we 'source.'", "/images/item_images/adidas_ZNE_Tee_Grey.jpg"),
(11, 15, "Women'S Mid-Rise 8Cm (Approx.) 2-In-1 Shorts", 7, 65, "These shorts are the ones that are down for everything you do—from long walks to HIIT to running errands. Their silky-smooth, ultra-soft woven fabric is balanced with sweat-wicking tech so you have ultimate comfort while feeling dry as you work out. The snug inner layer helps prevent chafing so you can push yourself with uncompromising coverage.", "/images/item_images/Women's_Mid-rise_8cm_(approx.)_2-in-1_Shorts.jpg"),
(12, 18, "Haven Wide Leg Pant", 7, 50, "Style to sit mid or low rise Relaxed full leg length Lightweight natural fabric Elastic waist with draw cord  Main 55% Linen (Flax), 45% Viscose (Viscose Rayon). Product Code 2057862-04", "/images/item_images/haven_wide_leg_pant.jpg"),
(13, 12, "Beige Abs Acrylic Spacer Beads", 10, 5, "Color Beige Material Plastic Main Stone NonStone", "/images/item_images/Beige_ABS_Acrylic_Spacer_Beads.jpg"),
(14, 19, "Airism Uv Protection Crew Neck Long Sleeve T-Shirt", 6, 20, "Long sleeve design provides sun protection. Quick-drying for stay-fresh comfort. UPF40.", "/images/item_images/AIRism_UV_Protection_Crew_Neck_Long_Sleeve_T-Shirt.jpg"),
(15, 17, "Regular Fit Windbreaker", 5, 75, "Regular-fit windbreaker in windproof, water-repellent nylon. Lined hood with an elasticated drawstring, a zip down the front and long sleeves with covered elastication at the cuffs. Zipped side pockets and an inner pocket with a press-stud. Concealed, elasticated drawstring at the hem. Lined. Article number 1160969004 Size Sleeve Length 66.5 N/A (Size L/L), Front Length 76.5 N/A (Size L/L) Length Regular length Sleeve Length Long sleeve Fit Regular fit Style Windbreaker Functions Water-repellent, Windproof Description Burgundy, Solid colour", "/images/item_images/Regular_Fit_Windbreaker.jpg"),
(16, 5, "Pink Anorak Jacket With Hood Drawstring", 11, 51, " A stylish and functional pink anorak jacket with a hood and drawstring. The jacket features a relaxed fit, a hooded neckline, and long sleeves. The anorak design is both warm and stylish, while the pink color is both eye-catching and feminine. The jacket is perfect for layering over sweaters, dresses, or jeans, and it is sure to keep you warm in even the most frigid temperatures. ", "/images/item_images/pink_anorak_jacket_with_hood_drawstring.jpg"),
(17, 20, "Chambray Button-Front Shirt", 1, 40, "A chambray shirt featuring a basic collar, chest patch pocket, button-front closures, long sleeves, and a scoop hem. Content + Care - 100% cotton - Machine wash cold Size + Fit - Model is 6'1' and wearing a Medium item code 00459126", "/images/item_images/Chambray_Button-Front_Shirt.jpg"),
(18, 16, "Textured Jacquard Shirt", 1, 99, "Relaxed fit shirt with a camp collar, long sleeves and a button-up front.", "/images/item_images/TEXTURED_JACQUARD_SHIRT.jpg"),
(19, 14, "Run Icon 3 Bar Tee Pink", 6, 59, "A LIGHTWEIGHT RUNNING T-SHIRT WITH A REFLECTIVE LOGO The Run Icons Running Tee was made for motion — whether you're heading out for a quick run before work, or going the extra mile on the weekend. With its classic fit and breathable, peach-soft fabric, the tee delivers lightweight mobility every time you hit the pavement. Using sweat wicking or absorbent materials, adidas AEROREADY products keep you feeling dry. Easily incorporate the t-shirt into your workout wardrobe thanks to the minimal design and reflective logo.", "/images/item_images/RUN_ICON_3_BAR_TEE_Pink.jpg"),
(20, 14, "Bucket Hat Blue", 10, 45, "A CLASSIC HAT WITH FRESH MATERIALS AND COLOURS. There's only one thing that beats the low-key style of a bucket hat — an adidas bucket hat in luxe, textured corduroy. Casually cool and effortlessly confident, this hat easily pairs with any outfit. Its rich and colourful print is an instant statement-maker.", "/images/item_images/Bucket_Hat_Blue.jpg"),
(21, 9, "Hollow Cross Ring Stainless Steel", 4, 64, " A stylish and edgy piece of jewelry, the Hollow Cross Ring Stainless Steel is a must-have for any man who wants to add a touch of rock and roll to his look. The ring is made from high-quality stainless steel and features a hollow cross design. The ring is available in a variety of sizes to fit any man's hand.", "/images/item_images/hollow_cross_ring_stainless_steel.jpg"),
(22, 15, "Women'S Over-Oversized Cardigan", 11, 109, "Rise up and transform your wardrobe with strong cosy vibes. You're sure to fall in love with the soft feel of brushed fleece, while the roomy design of this cardigan makes you feel—and look—stylishly carefree.", "/images/item_images/Women's_Over-Oversized_Cardigan.jpg"),
(23, 10, "Crystal Ball Ring", 10, 22, " A captivating and unique piece of jewelry, the Crystal Ball Ring is sure to turn heads. The ring features a clear crystal ball that is said to possess mystical powers. The crystal is set in a delicate silver band that is adjustable to fit any finger. The ring is perfect for those who are looking for a statement piece that is both beautiful and mysterious.", "/images/item_images/crystal_ball_ring.png"),
(24, 16, "Velvet Trousers", 2, 99, "Slim fit trousers with front pockets and rear welt pockets. Front zip fly and button fastening.", "/images/item_images/VELVET_TROUSERS.jpg"),
(25, 14, "Run It Shorts Turquoise", 2, 50, "GO-TO RUNNING SHORTS WITH INBUILT BRIEFS THAT FUSE STYLE AND FUNCTIONALITY. The latest adidas running range fuses style with function to keep you looking and feeling good while you put in the kms. The high-performance pieces were designed to minimize distraction on high-energy runs, so you can focus on having fun while you stride. Run your way to a better mood in the Run It Shorts — a wardrobe staple that seamlessly fuses aesthetics with functionality. Crafted from lightweight, peach-soft fabric, the shorts are cut for a regular fit with a mid rise drawcord waist. Inner briefs provide confident coverage and support as you run, while an oversized, reflective 3 Bars Logo ensures you stand out on your circuit. Sweat-wicking AEROREADY technology helps keep you feeling dry as the temperatures climb.", "/images/item_images/Run_It_Shorts_Turquoise.jpg"),
(26, 8, "Flower Brown T-Shirt", 6, 35, " A unique and stylish piece, the flower brown T-shirt is a must-have for any fashion-forward woman. The delicate floral print adds a touch of femininity, while the rich brown hue is both sophisticated and versatile. Whether you're pairing it with jeans for a casual look or a skirt for a more elevated ensemble, this T-shirt is sure to turn heads.", "/images/item_images/flower_brown_t-shirt.jpg"),
(27, 7, "Pink Star Dress", 8, 60, " A dreamy and ethereal pink dress with a star print. The dress features a flowing silhouette, delicate ruffles, and a soft and airy fabric. The star print is reminiscent of a starry night sky, adding a touch of whimsy and romance. The dress is perfect for any special occasion or for adding a touch of magic to your everyday life.", "/images/item_images/pink_star_dress.jpg"),
(28, 14, "Lounge French Terry Shorts", 7, 69, "COMFORTABLE SHORTS WITH A LAID-BACK LOOK. You'll have a hard time finding anything you don't love about these adidas shorts. The cotton French terry feels buttery soft and so comfortable, and the loose shape lets you move around freely. The high rise stays put at your natural waist while a drawcord lets you find your perfect fit. We partner with Better Cotton to improve cotton farming globally. Better Cotton makes global cotton production better for the people who produce it, better for the environment it grows in, and better for the sector's future. Better Cotton is sourced via a chain-of-custody model called mass balance. This means that Better Cotton is not physically traceable to end products. However, Better Cotton Farmers benefit from the demand for Better Cotton in equivalent volumes to those we 'source.'", "/images/item_images/LOUNGE_FRENCH_TERRY_SHORTS.jpg"),
(29, 10, "Hiking Pants Brown", 7, 16, " These versatile and stylish hiking pants are perfect for any outdoor adventure. The durable fabric is water-resistant and abrasion-resistant, making them ideal for rugged terrain. The pants also feature multiple pockets for storing essentials, such as a phone, wallet, and keys. The brown color is both stylish and practical, as it helps to hide dirt and stains.", "/images/item_images/hiking_pants_brown.jpg"),
(30, 14, "Adicolor Classics Trefoil Tee White", 1, 59, "A CASUAL TEE WITH BIG ADIDAS ENERGY The Trefoil logo is steeped in sport and style history. But it's about more than that. It represents a fearless energy and a clan of creators striving to be their best at every step. Slip into the comfort of this adidas t-shirt and show it off. By buying cotton products from us, you're supporting more sustainable cotton farming.", "/images/item_images/ADICOLOR_CLASSICS_TREFOIL_TEE_White.jpg"),
(31, 15, "Nike Form Men'S Dri-Fit Hooded Versatile Jacket", 5, 99, "Built for running, training and yoga, this stretchy, sweat-wicking jacket is designed to help you stay fresh through your entire workout. Cut with a relaxed feel, this hooded full-zip keeps your essentials close with pocket storage on the way to and from the gym.", "/images/item_images/Nike_Form_Men's_Dri-FIT_Hooded_Versatile_Jacket.jpg"),
(32, 20, "Active Funnel Neck Jacket", 11, 35, "Details An athletic knit jacket featuring a zip-front closure, funnel neck, ribbed trim, and long sleeves.- Matching bottoms available. Complete the look with 00490296. Content + Care - 87% polyester, 13% spandex - Hand wash cold Size + Fit - Model is 5'7' and wearing a Small", "/images/item_images/Active_Funnel_Neck_Jacket.jpg"),
(33, 14, "Own The Run Shorts Black", 2, 69, "LIGHTWEIGHT, DRAWCORD SHORTS WITH POCKETS, MADE FOR EVERYDAY RUNNING. Whether you're hitting the pavement with your community or on your own, there's nothing quite like the joyful rush of a runner's high. One thing's for sure comfort and support are paramount in maximizing your daily run. The Own the Run Shorts exceed all expectations, combining iconic design details, like 3-Stripes, with modern innovation. Runner-designed and real-world-tested, they're built with lightweight fabric and feature sweat-wicking AEROREADY technology to keep you feeling dry. Reflective details help you stand out in low light, while a zip device pocket keeps you connected on your route. We have reduced the carbon footprint of this product by a minimum of 10% when compared to its previous version. Less greenhouse gas emissions, including CO2, for the full life cycle – from creation all the way to the end-of-life.", "/images/item_images/Own_the_Run_Shorts_Black.jpg"),
(34, 15, "Nike Dugout Men'S Loose Satin Jacket", 5, 219, "Classic in all the right ways, our dugout jacket re-imagines timeless varsity style with modern touches to keep you looking and feeling your best today. The exterior uses water-repellent satin to help keep you dry, while the interior insulation helps keep you warm when the temperature drops.", "/images/item_images/Nike_Dugout_Men's_Loose_Satin_Jacket.jpg"),
(35, 15, "Nike Challenger Men'S Brief-Lined Running Shorts", 2, 45, "The iconic Nike Challenger Shorts deliver woven comfort with an all-new articulated brief. Mesh details and secure storage give the versatility you want from everyday shorts. This product is made from at least 75% recycled polyester fibres.", "/images/item_images/Nike_Challenger_Men's_Brief-Lined_Running_Shorts.jpg"),
(36, 13, "Born In Anaheim Loose Crew Sweatshirt", 5, 109, "The Born In Anaheim Loose Crew Sweatshirt is a pullover crewneck sweatshirt that's made with a comfortable cotton-blend fleece and features embroidery on the sleeve and printed butterfly graphic on the front.", "/images/item_images/BORN_IN_ANAHEIM_LOOSE_CREW_SWEATSHIRT.jpg"),
(37, 5, "Fashion Casual Shoes", 3, 53, " Casual sneaker shoes branded 'Fashion' are a stylish and comfortable option for men who want a shoe that can keep up with their active lifestyle. They are perfect for everyday wear, and can be paired with jeans, shorts, or chinos. These shoes typically feature a durable canvas or leather upper, a cushioned midsole for shock absorption and support, and a non-slip rubber outsole for traction on a variety of surfaces.", "/images/item_images/fashion_casual_shoes.jpg"),
(38, 11, "White Dress With Orange Flowers", 8, 30, " A classic and timeless white dress adorned with vibrant orange flowers. The dress features a flattering silhouette that is both elegant and playful, while the orange flowers add a touch of whimsy and sophistication. The contrast between the white and orange creates a striking visual impact, making it a perfect choice for any special occasion. ", "/images/item_images/white_dress_with_orange_flowers.jpg"),
(39, 18, "Hailey Babydoll Mini Dress", 8, 50, "Cotton poplin Sweetheart neckline Non usable buttons on corset waist detail Flutter sleeve Elasticated shoulder straps Tiered skirt with frill Mini length Elasticated back waist Composition Product Code 2057192-03", "/images/item_images/Hailey_Babydoll_Mini_Dress.jpg"),
(40, 19, "Airism Cotton Striped Crew Neck Oversized T-Shirt", 1, 30, "Smooth 'AIRism' with the look of cotton. Versatile narrow stripe design.", "/images/item_images/AIRism_Cotton_Striped_Crew_Neck_Oversized_T-Shirt.jpg"),
(41, 15, "Women'S Mid-Rise Brief-Lined Running Shorts", 7, 55, "Whether you're racking up the miles or jogging to the corner shop, these loose-fitting shorts help keep you feeling cool and confident. Their silky-smooth, ultra-soft woven fabric is balanced with sweat-wicking tech so you have ultimate comfort while feeling dry. And, no need to check your eyes the double Swoosh graphic on the left leg mimics movement to inspire you to keep going.", "/images/item_images/Women's_Mid-Rise_Brief-Lined_Running_Shorts.jpg"),
(42, 15, "Nike Sportswear Men'S Long-Sleeve T-Shirt", 1, 59, "Midweight cotton is paired with a relaxed fit and puff-printed Nike graphics for a casual, everyday look, rooted in quality. Pull it on with your favourite Nike sneakers for easy comfort and style.", "/images/item_images/Nike_Sportswear_Men's_Long-Sleeve_T-Shirt.jpg"),
(43, 15, "Jordan Sport Women'S Diamond Tank To", 6, 49, "Breeze through your workouts in this lightweight mesh tank top. Loose fitting with a hem that falls below the waist, it's designed to let you move freely. And check out the panel on the back—its Diamond shape recalls one of Jordan's most iconic designs.", "/images/item_images/Jordan_Sport_Women's_Diamond_Tank_Top.jpg"),
(44, 14, "Ultraboost Light Shoes Grey", 3, 289, "ULTRALIGHT RUNNING SHOES MADE IN PART WITH PARLEY OCEAN PLASTIC. Lace up in a pair of Ultraboost Light running shoes and experience energy return like never before. They feature a Light BOOST midsole, our next generation of BOOST and our lightest one yet, designed to keep you going strong through runs of any distance and pace. The Linear Energy Push system, integrated with the outsole, increases stability, and foot-hugging adidas PRIMEKNIT tops it off for a smooth, responsive ride. This shoe's upper is made with a high-performance yarn which contains at least 50% Parley Ocean Plastic — reimagined plastic waste, intercepted on remote islands, beaches, coastal communities and shorelines, preventing it from polluting our ocean. The other 50% of the yarn is recycled polyester.", "/images/item_images/Ultraboost_Light_Shoes_Grey.jpg"),
(45, 19, "Airism Cotton Sleeveless T-Shirt", 1, 15, "Smooth 'AIRism' fabric with the look of cotton. Versatile basic design and cut.", "/images/item_images/AIRism_Cotton_Sleeveless_T-Shirt.jpg"),
(46, 13, "Vans X Zion Wright Denim Carpenter Pant", 2, 99, "Vans x Zion Wright Denim Carpenter Pant 100% Cotton", "/images/item_images/VANS_X_ZION_WRIGHT_DENIM_CARPENTER_PANT.jpg"),
(47, 17, "Crinkled Shirt", 6, 48, "Shirt in a crinkled weave with a collar, buttons down the front and a yoke with a box pleat at the back. Dropped shoulders, long sleeves with buttoned cuffs and a sleeve placket with a link button. Rounded hem. Slightly longer at the back. Article number 1176477003 Size Back Length 78.8 N/A (Size M/T), Shoulder Width 51.5 N/A (Size M/T), Sleeve Length 59.9 N/A (Size M/T) Length Regular length Sleeve Length Long sleeve Collar Turn-down collar Description Pink/White, Striped Concept EVERYDAY FASHION", "/images/item_images/Crinkled_shirt.jpg"),
(48, 9, "Traditional Chinese Gold Ring", 10, 21, " A symbol of love, prosperity, and good fortune, the Traditional Chinese Gold Ring is a cherished piece of jewelry that is often passed down through generations. Made from high-quality gold, these rings are typically adorned with intricate designs that are said to bring blessings to the wearer. Some of the most common designs include dragons, phoenixes, and flowers.", "/images/item_images/traditional_chinese_gold_ring.jpg"),
(49, 19, "Ultra Stretch Colour Jeans", 2, 40, "Designed with ultra stretch fabric. Skinny but not constricting for superb comfort.", "/images/item_images/Ultra_Stretch_Colour_Jeans.jpg"),
(50, 17, "Rhinestone-Embellished Denim Jacket", 11, 440, "Studio Collection. Cotton denim jacket fully adorned with super-sparkly rhinestones that capture the spotlight perfectly. The glam air is combined with an oversized fit, a cropped cut and extended shoulders to create a boxy-style, winged silhouette. Pointed collar, buttons down the front and long, wide sleeves with buttoned cuffs. Shaping seams and a yoke at the front and back. Flap chest pockets with a button, discreet side pockets and tabs with adjustable buttoning at the back of the hem. Article number 1207075001 Length Cropped Sleeve Length Long sleeve Fit Oversized Collar Turn-down collar Description Charcoal grey/Silver-coloured Collection H&M Studio Collection 90 Oversized, trucker-style jacket in rigid cotton denim with a collar, buttons down the front and a yoke at the front and back. Dropped shoulders, buttoned cuffs, discreet side pockets and flap chest pockets with a button. Article number 1163273006 Size Back Length 69.2 N/A (Size M/T), Shoulder Width 62.9 N/A (Size M/T), Sleeve Length 56.6 N/A (Size M/T) Length Regular length Sleeve Length Long sleeve Fit Oversized Collar Turn-down collar Style Trucker jacket Description Denim blue, Solid colour Concept DIVIDED", "/images/item_images/Rhinestone-embellished_denim_jacket.jpg"),
(51, 12, "Shein Lune Shirred Waist Wide Leg Pants", 7, 12, "Color Navy Blue Style Casual Pattern Type Plain Type Wide Leg Closure Type Elastic Waist Details Shirred Waist Line High Waist Length Capris Fit Type Loose Fabric Non-Stretch Material Fabric Composition 95% Polyester, 5% Elastane Care Instructions Machine wash or professional dry clean Temperature Spring/Fall (18-25℃/63-77℉) Body Unlined Sheer No", "/images/item_images/SHEIN_LUNE_Shirred_Waist_Wide_Leg_Pants.jpg"),
(52, 3, "Slim Fit Long Sleeve Dress Shirts", 1, 40, " Look your best with the Slim Fit Long Sleeve Dress Shirt. This shirt is made from a high-quality fabric that is both comfortable and durable. It features a slim fit design that flatters the figure, as well as a button-down front and long sleeves with buttoned cuffs. The shirt is available in a variety of colors and styles to choose from, so you can find the perfect one to match your needs. Whether you're dressing for work, a special event, or a night out on the town, the Slim Fit Long Sleeve Dress Shirt is the perfect choice. It's a versatile shirt that can be dressed up or down, and it's sure to turn heads wherever you go.", "/images/item_images/slim_fit_long_sleeve_dress_shirts.jpg"),
(53, 14, "Own The Run Long Sleeve Tee Blue", 1, 59, "A COMFORTABLE T-SHIRT MADE WITH RECYCLED MATERIALS. If dusk and dawn are your favourite times to run, you'll appreciate the long sleeve coverage of this adidas running t-shirt. Thumbholes hold the sleeves comfortably in place. AEROREADY absorbs moisture so you always feel your best — no matter your distance or pace. Made with 100% recycled content, this product represents just one of our solutions to help end plastic waste.", "/images/item_images/Own_the_Run_Long_Sleeve_Tee_Blue.jpg"),
(54, 17, "Rhinestone-Embellished Stone Rin", 10, 89, "Studio Collection. Dramatic metal ring with a faceted, pointy glass stone in a rhinestone-embellished claw setting. Width of stone 2.3 cm. Article number 1195414001 Description Silver-coloured/Deep purple Collection H&M Studio Collection", "/images/item_images/Rhinestone-embellished_stone_ring.jpg"),
(55, 13, "Color Theory Authentic", 9, 95, "The Color Theory Collection allows you to create a unique color story by pairing vibrant, unexpected hues with our iconic footwear styles. Made with an old school canvas upper, the Color Theory Authentic honors our original Vans silhouette while offering a fresh look that boosts the appeal of this timeless shoe.", "/images/item_images/COLOR_THEORY_AUTHENTIC.jpg"),
(56, 10, "Skeleton Hand Ring", 4, 26, " A unique and eye-catching piece of jewelry, the Skeleton Hand Ring is a must-have for any man who wants to add a touch of edge to his look. The ring is made from high-quality materials and features a detailed skeleton hand design. The ring is available in a variety of sizes to fit any man's hand.", "/images/item_images/skeleton_hand_ring.jpg"),
(57, 15, "Women'S High-Waisted Wide-Leg Knit Trousers", 7, 139, "Who says a laid-back look can't also be put together? Made from a textured knit fabric that's both warm and breathable, these wide-leg trousers are designed to keep you cosy whether you're running errands or chilling at home. And the bold print ensures you'll be the centre of attention—in the best way possible!", "/images/item_images/Women's_High-Waisted_Wide-Leg_Knit_Trousers.jpg"),
(58, 15, "Women'S Cross-Body Bag (1L)", 10, 55, "A versatile and stylish design, the Nike Sportswear Futura Cross-Body Bag can be worn as a hip pack, over-the-shoulder, clutch or cross-body bag. 2 zip pockets help keep your essentials organised, while a satin lining and Swoosh zip pulls elevate the look. This product is made from at least 65% recycled polyester fibres.", "/images/item_images/Women's_Cross-Body_Bag_(1L).jpg"),
(59, 12, "Shein Lune Solid Zip Up Thermal Lined Hoodie", 11, 30, "Color Black Style Casual Pattern Type Plain Details Pocket, Zipper Type Zip Up Neckline Hooded Sleeve Length Long Sleeve Sleeve Type Drop Shoulder Length Long Fit Type Loose Features Warming Fabric Slight Stretch Material Fabric Composition 95% Polyester, 5% Elastane Care Instructions Machine wash or professional dry clean Temperature Late Fall (10-17℃/50-63℉) Lined For Added Warmth Yes Sheer No", "/images/item_images/SHEIN_LUNE_Solid_Zip_Up_Thermal_Lined_Hoodie.jpg"),
(60, 18, "Harlow High To", 9, 25, "Looking to finish off your outfit with a classic, then the Rubi shoes Harlow high top is perfect for you.", "/images/item_images/Harlow_High_Top.jpg"),
(61, 8, "Distressed Ripped Denim Shorts", 7, 43, " These edgy and stylish shorts are perfect for adding a touch of rock and roll to your wardrobe. The distressed and ripped detailing gives them a cool and lived-in look, while the denim fabric is both comfortable and durable. The shorts are perfect for pairing with a variety of tops, from tees and tanks to blouses and sweaters.", "/images/item_images/distressed_ripped_denim_shorts.jpg"),
(62, 16, "Pleated Satin Trousers", 2, 99, "Trousers made of satin fabric. Front pleated details at the waist. Front pockets and rear welt pockets. Front zip fly and button fastening.", "/images/item_images/PLEATED_SATIN_TROUSERS.jpg"),
(63, 17, "Relaxed Fit Twill Pull-On Trousers", 2, 55, "Cotton twill trousers in a relaxed fit with covered elastication and a drawstring at the waist and a fake fly. Diagonal side pockets and open back pockets. Article number 1063055001 Size Inside leg Length 76.0 N/A (Size L/L) Length Long Waist Rise Regular waist Fit Relaxed fit Style Pull-on trousers Description Black, Solid colour", "/images/item_images/Relaxed_Fit_Twill_pull-on_trousers.jpg"),
(64, 15, "Nike Sportswear Men'S Oversized T-Shirt", 1, 75, "Time to elevate your T-shirt collection? This tee answers the call. Heavyweight cotton and a clean, embroidered Futura logo keep it simple for pairing up with any outfit. The oversize fit gives you plenty of extra space for casual style and easy layering.", "/images/item_images/Nike_Sportswear_Men's_Oversized_T-shirt.jpg"),
(65, 17, "Long Sequined Dress", 8, 130, "Long, fitted dress in sequined mesh with a stand-up collar and a keyhole opening with concealed buttons at the back of the neck. Long sleeves and a slit at the back of the hem. Short underdress in jersey with narrow, adjustable shoulder straps. Article number 1201480002 Length Midi Sleeve Length Long sleeve Fit Fitted Collar Stand-up collar Style Keyhole, Slit Description Black, Solid colour Concept EVERYDAY FASHION", "/images/item_images/Long_sequined_dress.jpg"),
(66, 16, "Short Knit Beanie", 4, 30, "Knit beanie made of stretch spun cotton fabric. Turn-up brim.", "/images/item_images/SHORT_KNIT_BEANIE.jpg"),
(67, 6, "Blue Belted Dress", 8, 41, " This elegant blue belted dress is perfect for any special occasion. The flattering silhouette is both stylish and sophisticated, and the belted waist accentuates the figure. The dress is made from a high-quality fabric that is both comfortable and durable.", "/images/item_images/blue_belted_dress.jpg"),
(68, 15, "Nike Acg Men'S T-Shirt", 1, 49, "Breathe in that fresh air with this spacious, soft tee. It feels like a classic, with a slightly baggy fit. And when you're out enjoying the great outdoors, the lung-shaped graphic reminds you to stop, breathe and take in the scenery. This product is made from 100% sustainable materials, using a blend of both recycled polyester and organic cotton fibres. The blend is at least 10% recycled fibres or at least 10% organic cotton fibres.", "/images/item_images/Nike_ACG_Men's_T-Shirt.jpg"),
(69, 11, "Casual Sports Oversized Jacket", 5, 34, " The Casual Sports Oversized Jacket is the perfect jacket for the man who wants to look stylish and comfortable at the same time. It is made from high-quality materials and features a relaxed, oversized fit that is perfect for layering. The jacket also has a number of features that make it ideal for everyday wear, such as a water-resistant finish, multiple pockets, and a drawcord hem.", "/images/item_images/casual_sports_oversized_jacket.jpg"),
(70, 15, "Women'S Mid-Rise 8Cm (Approx.) Brief-Lined Shorts", 7, 49, "These shorts are the ones that are down for everything you do—from long walks to HIIT to running errands. Their silky-smooth, ultra-soft woven fabric is balanced with sweat-wicking tech so you have ultimate comfort while feeling dry as you work out.", "/images/item_images/Women's_Mid-rise_8cm_(approx.)_Brief-Lined_Shorts.jpg"),
(71, 13, "Rain Camo Crew Sweatshirt", 5, 139, "The Rain Camo Crew Sweatshirt is a fleece crewneck sweatshirt with an allover rain camo print and finished with a front patch logo.", "/images/item_images/RAIN_CAMO_CREW_SWEATSHIRT.jpg"),
(72, 18, "Classic Sweatpant", 7, 35, "Our classic sweatpants are exactly that. With an elasticated, mid-rise waist, cuffed ankles and lightweight fabric, they're perfect for working out, vegging out or heading out. Product Code 2057296-02", "/images/item_images/classic_sweatpant.jpg"),
(73, 17, "Off-The-Shoulder Corset To", 6, 35, "Short, fitted, off-the-shoulder corset top in a stretch weave with short, ruched sleeves, shaped cups and visible seams at the front and back. Concealed zip and hook-and-eye fastener at the back and an asymmetric hem at the front. Unlined. Article number 1174870002 Length Short Sleeve Length Sleeveless Fit Fitted Style Corset top, Off-the-shoulder Neckline Sweetheart neckline Description Black, Solid colour Concept DIVIDED", "/images/item_images/Off-the-shoulder_corset_top.jpg"),
(74, 12, "Manfinity Homme Men Solid Drawstring Waist Shorts", 2, 15, "Color Black Style Casual Pattern Type Plain Details Drawstring Type Straight Leg Closure Type Drawstring Waist Waist Line Natural Length Short Fit Type Loose Fabric Non-Stretch Material Linen Composition 97% Polyester, 3% Elastane Care Instructions Machine wash or professional dry clean Sheer No", "/images/item_images/Manfinity_Homme_Men_Solid_Drawstring_Waist_Shorts.jpg"),
(75, 6, "Batman Ring", 4, 54, " A symbol of courage, justice, and the power of the human spirit, the Batman ring is a must-have for any fan of the Dark Knight. Made from high-quality materials, this ring is both stylish and durable, and is sure to make a statement. Whether you're dressing up for a costume party or just adding a touch of Batman to your everyday look, this ring is the perfect way to show your fandom.", "/images/item_images/batman_ring.jpg"),
