(86, 17, "Regular Fit Cotton Shorts", 2, 18, "Regular-fit shorts in a cotton weave with covered elastication and a drawstring at the waist, fake fly, side pockets and a welt back pocket. Article number 1037593001 Size Inside leg Length 18.0 N/A (Size L/L) Length Knee length Waist Rise Regular waist Fit Regular fit Description Black, Solid colour Concept DIVIDED", "/images/item_images/Regular_Fit_Cotton_shorts.jpg"),
(87, 13, "Comfycush Crew", 11, 55, "When we first envisioned the ComfyCush Sweats collection, we knew we wanted to create the softest, most comfortable sweats you have ever worn. With a focus on fabric and construction, the ComfyCush Oversized Fleece Pullover Crew is made with super soft sueded fleece that feels like a dream, flatlock seams that eliminate chafing, and simple panels that offer less stitching and more stretch. Once you put it on, you’ll never want to take it off.", "/images/item_images/COMFYCUSH_CREW.jpg"),
(88, 14, "4Dfwd 3 Running Shoes Grey", 3, 299, "CODED FOR FORWARD MOTION, THESE RUNNING SHOES PROVIDE A SMOOTH RIDE. Whether you're focused on your next stride or the finish line, running is all about moving forward. That's why the 4DFWD 3 running shoes are coded for forward motion. We updated the innovative 3D-printed adidas 4D midsole with a new lattice structure that transforms impact forces into forward motion and combined it with the extraordinary traction of a Continental™ Rubber outsole. Adaptive adidas PRIMEKNIT is paired with light, breathable mesh to keep your feet comfortable, kilometre after kilometre.", "/images/item_images/4DFWD_3_Running_Shoes_Grey.jpg"),
(89, 15, "Women'S Woven High-Waisted Trousers", 7, 119, "With a versatile look and relaxed feel, these trousers are the perfect foundation piece for a day-to-night 'fit. The woven fabric is smooth and structured but still light enough to wear in warmer weather.", "/images/item_images/Women's_Woven_High-Waisted_Trousers.jpg"),
(90, 12, "Lapel Neck Single Button Blazer", 11, 25, "Color Black Style Casual Pattern Type Plain Details Button, Pocket Length Long Type Regular Temperature Spring/Fall (18-25℃/63-77℉) Pockets No Body Unlined Neckline Shawl Collar Sleeve Length Long Sleeve Sleeve Type Regular Sleeve Placket Single Button Fit Type Regular Fit Fabric Non-Stretch Material Fabric Composition 95% Polyester, 5% Elastane Care Instructions Machine wash, do not dry clean Sheer No", "/images/item_images/Lapel_Neck_Single_Button_Blazer.jpg"),
(91, 14, "Glam Goth Shopper Bag Black", 10, 99, "A VELVET SHOPPER BAG MADE IN PART WITH RECYCLED MATERIALS. Effortless in style, the adidas Glam Goth Shopper Bag adds a vintage edge to any look. This versatile bag can be worn as a crossbody or carried over the shoulder. The velvet construction and bold Trefoil monogram pattern make it the perfect daytime accessory while the top snap closure and detachable strap keep your items secure. Plus, there's plenty of room inside for all your daily essentials. Made with a series of recycled materials, and at least 40% recycled content, this product represents just one of our solutions to help end plastic waste.", "/images/item_images/Glam_Goth_Shopper_Bag_Black.jpg"),
(92, 20, "Stonewash Slim-Fit Jeans", 2, 67, "A pair of slim-fit jeans featuring a stonewash, whiskering, zip fly with button closure, five-pocket construction, and belt loops. Content + Care - 98% cotton, 2% spandex - Organically grown cotton - Machine wash warm Size + Fit - Model is 6'1' and wearing a Size 32 item code 00457812", "/images/item_images/Stonewash_Slim-Fit_Jeans.jpg"),
(93, 12, "Dazy Split Hem Flare Leg Jeans", 7, 30, "Color Light Wash Pattern Type Plain Type Flare Leg Closure Type Zipper Fly Details Button, Pocket, Split, Zipper Waist Line Natural Length Long Fit Type Regular Fit Fabric Medium Stretch Material Denim Composition 70% Cotton, 28% Polyester, 2% Elastane Care Instructions Machine wash, do not dry clean Body Unlined Sheer No", "/images/item_images/DAZY_Split_Hem_Flare_Leg_Jeans.jpg"),
(94, 7, "Cargo Techwear Windbreaker", 5, 61, " The Cargo Techwear Windbreaker is the perfect jacket for the modern man. It is made from high-quality materials and features a stylish and functional design. The jacket is water-resistant and windproof, so it will keep you protected from the elements in all weather conditions. The Cargo Techwear Windbreaker has a number of features that make it ideal for everyday wear. It has a relaxed fit that allows for easy movement, and it features multiple pockets for storing your belongings. The jacket also has a reflective hood for added safety at night.", "/images/item_images/cargo_techwear_windbreaker.jpg"),
(95, 5, "Skmei Fashion Leather Watch", 4, 66, " A stylish and affordable timepiece, the Skmei Fashion Leather Watch is the perfect addition to any man's wardrobe. The classic design is both versatile and timeless, while the leather strap adds a touch of sophistication. The watch is powered by a high-quality quartz movement, ensuring accurate timekeeping. Whether you're dressing up for a formal event or adding a touch of style to your everyday look, this watch is sure to make a statement.", "/images/item_images/skmei_fashion_leather_watch.jpg"),
(96, 13, "Comfycush Relaxed Sweatpant", 7, 60, "When we first envisioned the ComfyCush Sweats collection, we knew we wanted to create the softest, most comfortable sweats you have ever worn. With a focus on fabric and construction, the ComfyCush Relaxed Sweatpant is made with super soft sueded fleece that feels like a dream, flatlock seams that eliminate chafing, and simple panels that offer less stitching and more stretch. Once you put it on, youll never want to take it off.", "/images/item_images/COMFYCUSH_RELAXED_SWEATPANT.jpg"),
(97, 15, "Nike Swoosh Women'S Medium-Support Padded Sports Bra Tank", 6, 85, "When you want it all, this tank is the pick. The iconic Swoosh bra is built in and smooth, stretchy fabric snuggly holds you, so you're set with everything you need to go from the office to the gym and back again. With sewn-in padding and a racerback silhouette, you can feel confident that nothing is shifting as you go about your day.", "/images/item_images/Nike_Swoosh_Women's_Medium-support_Padded_Sports_Bra_Tank.jpg"),
(98, 14, "Ultrabounce Shoes White", 9, 119, "CUSHIONED RUNNING SHOES MADE IN PART WITH RECYCLED MATERIALS. Ready to ramp up your training? These adidas shoes help you take the next step in your running journey. Lightweight Bounce cushioning provides comfort and flexibility to keep you energised when you add kilometres to your daily run. The long-lasting rubber outsole ensures traction on varied surfaces so you can stride with confidence.", "/images/item_images/Ultrabounce_Shoes_White.jpg"),
(99, 18, "Box Fit Graphic Tshirt", 1, 35, "The Box Fit Graphic T-shirt is your new wardrobe staple. Elevated heavy weight fabrication, boxy fit featuring a drop shoulder and longer sleeve length with a range of elevated prints & embroidery.", "/images/item_images/Box_Fit_Graphic_TShirt.jpg"),
(100, 15, "Women'S Corduroy Chicago Trousers", 7, 139, "Utility, but make it cool. Our Chicago trousers, replete with all the pockets you could possibly need (plus adjustable cuffs and elastic in the waistband), feature a heavyweight velvet corduroy fabric that lends a luxurious feel to the wide-legged silhouette.", "/images/item_images/Women's_Corduroy_Chicago_Trousers.jpg"),
(101, 15, "Nike Sportswear Men'S Oversized Long-Sleeve T-Shirt", 1, 75, "We took inspiration from vintage sports tees and shined up the graphics on this premium, heavyweight cotton tee. With fresh Nike graphics and embroidered detailing, this oversized top elevates any outfit. Pair it up with your favourite retro Nike sneakers for a polished finish.", "/images/item_images/Nike_Sportswear_Men's_Oversized_Long-Sleeve_T-Shirt.jpg"),
