(108, 2, "R Varsity Jacket", 5, 63, " The R-letter design Varsity Jacket is a stylish and unique piece of outerwear that is perfect for the man who wants to stand out from the crowd. It is made from high-quality materials and features a classic varsity design with a bold R-letter design on the front. The jacket also has a number of features that make it ideal for everyday wear, such as a water-resistant finish, multiple pockets, and a snap button closure.", "/images/item_images/r_varsity_jacket.jpg"),
(109, 7, "Green Casual Summer Shorts", 2, 69, " A pair of light and breathable shorts, perfect for hot summer days. The green color is both stylish and versatile, and the shorts can be dressed up or down to suit any occasion.", "/images/item_images/green_casual_summer_shorts.jpg"),
(110, 12, "Floral & Patchwork Backless Bandana Cami To", 6, 6, "Color Multicolor Style Sexy Pattern Type Floral, Figure Type Cami Neckline Spaghetti Strap Details Criss Cross, Backless, Asymmetrical, Lettuce Trim, Tie Back Hem Shaped Asymmetrical Length Crop Fit Type Slim Fit Fabric Slight Stretch Material Knitted Fabric Composition 94% Polyester, 6% Elastane Care Instructions Machine wash or professional dry clean Sheer No Lining 100% Polyester", "/images/item_images/Floral_&_Patchwork_Backless_Bandana_Cami_Top.jpg"),
(111, 15, "Jordan Women'S Oversized T-Shirt", 6, 79, "A good graphic tee can really tie your whole outfit together. This one features an oversized fit and a '90s-inspired graphic. A heavy snow wash ups the vintage vibe.", "/images/item_images/Jordan_Women's_Oversized_T-Shirt.jpg"),
(112, 13, "Mix Match Relax Cardigan", 11, 96, "Your favorite cozy cardigan gets a makeover with the Mix Match Relax Cardigan. Featuring an eye-catching allover checkerboard print, this bold buttondown sweater has a relaxed fit that looks great open or closed. Dropped shoulders, billowy bloussant sleeves, and left chest logo embroidery complement the look, ensuring that this statement cardigan become your cool weather go-to.", "/images/item_images/MIX_MATCH_RELAX_CARDIGAN.jpg"),
(113, 4, "Dark Green Dress", 8, 57, " This sophisticated dark green dress is perfect for any special occasion. The elegant silhouette is both stylish and flattering, and the rich color is sure to turn heads. The dress is made from a high-quality fabric that is both comfortable and durable.", "/images/item_images/dark_green_dress.jpg"),
