(118, 13, "Born Butterfly Long Sleeve Tee", 1, 69, "The Born Butterfly Long Sleeve T-Shirt is a long sleeve crewneck tee made from a heavier weight cotton and features a printed Vans logo on the front and butterfly inspired graphic paying homage to our Anaheim roots on the back.", "/images/item_images/BORN_BUTTERFLY_LONG_SLEEVE_TEE.jpg"),
