(120, 16, "Asymmetric Soft Top", 6, 56, "Turtleneck top with a turn-down detail and drop sleeves. Asymmetric hem.", "/images/item_images/ASYMMETRIC_SOFT_TOP.jpg"),
(121, 8, "Round Toes Square Heel Brogues White", 9, 49, " A timeless and versatile footwear option, these round toe square heel brogues in white are a must-have for any wardrobe. The classic brogue detailing adds a touch of sophistication, while the white hue is both fresh and feminine. The round toe provides a comfortable fit, while the square heel adds a touch of height and style. Whether you're pairing them with trousers for a formal look or a skirt for a more feminine ensemble, these brogues are sure to elevate your outfit.", "/images/item_images/round_toes_square_heel_brogues_white.jpg"),
(122, 16, "Satin Cargo Trousers", 7, 76, "High-waist straight-leg trousers. Front pockets, side patch pockets with flaps and false back welt pockets. Front zip and button fastening.", "/images/item_images/SATIN_CARGO_TROUSERS.jpg"),
(123, 5, "Cute Pink Cargo Pants", 7, 15, " These adorable and stylish cargo pants are perfect for adding a touch of fun and femininity to your wardrobe. The soft pink color is both trendy and flattering, and the relaxed fit is perfect for everyday wear. The pants feature multiple pockets for added functionality, and they can be dressed up or down depending on the occasion.", "/images/item_images/cute_pink_cargo_pants.jpg"),
(124, 11, "Lime Green Cargo Pants", 7, 55, " These stylish and eye-catching cargo pants are perfect for adding a touch of fun and personality to your wardrobe. The lime green color is both trendy and flattering, and the relaxed fit is perfect for everyday wear. The pants feature multiple pockets for added functionality, and they can be dressed up or down depending on the occasion.", "/images/item_images/lime_green_cargo_pants.jpg"),
(125, 13, "Color Theory Classic Slip-On", 9, 95, "The Color Theory Collection allows you to create a unique color story by pairing vibrant, unexpected hues with our iconic footwear styles. Made with an old school canvas upper, the Color Theory Checkerboard Classic Slip-On honors our legendary laceless silhouette while offering a fresh look that boosts the appeal of this easy-to-wear shoe.", "/images/item_images/COLOR_THEORY_CLASSIC_SLIP-ON.jpg"),
(126, 12, "Kangaroo Pocket Drawstring Thermal Hoodie", 11, 15, "Color Apricot Style Casual Pattern Type Letter Details Drawstring, Pocket Type Pullovers Neckline Hooded Sleeve Length Long Sleeve Sleeve Type Drop Shoulder Length Regular Fit Type Regular Fit Fabric Slight Stretch Material Fabric Composition 100% Polyester Care Instructions Machine wash or professional dry clean Temperature Spring/Fall (18-25℃/63-77℉) Pockets Yes Lined For Added Warmth Yes Sheer No", "/images/item_images/Kangaroo_Pocket_Drawstring_Thermal_Hoodie.jpg"),
(127, 17, "Satin Halterneck To", 6, 25, "Short halterneck top in softly draping satin with a cowl neckline and concealed buttons at the back of the neck. Concealed zip and hook-and-eye fastening at one side. Jersey lining. Article number 1203195002 Length Short Sleeve Length Sleeveless Fit Regular fit Neckline Cowl neck, Halterneck Description Green, Solid colour Concept EVERYDAY FASHION", "/images/item_images/Satin_halterneck_top.jpg"),
(128, 15, "Nike Air Vapormax 2023 Flyknit Men'S Shoes", 3, 299, "Have you ever walked on Air? Step into the Air VaporMax 2023 to see how it's done. The innovative tech is revealed through the perforated sockliner (pull it out to see more). The stretchy Flyknit upper is made from at least 20% recycled content by weight.", "/images/item_images/Nike_Air_VaporMax_2023_Flyknit_Men's_Shoes.jpg"),
(129, 15, "Nike Windrunner Men'S Repel Running Jacket", 5, 169, "Our iconic Windrunner jacket is ready for the next chapter. Built for rainy days, this super-lightweight running jacket repels water, so staying dry is never a problem. What about sunny days? UV-blocking fabric provides protection in the areas covered by the jacket. Plus, it's packable and designed with plenty of airflow and breathability so you can keep cool on your next run—no matter what distance you go.", "/images/item_images/Nike_Windrunner_Men's_Repel_Running_Jacket.jpg"),
(130, 19, "American Sleeve Cropped Bra Sleeveless To", 6, 20, "Updated to a sleeker design. Perfect for wearing on its own or layering.", "/images/item_images/American_Sleeve_Cropped_Bra_Sleeveless_Top.jpg"),
(131, 16, "Flat Chelsea Boots", 9, 76, "Flat Chelsea boots. Elastic side gores. Back pull tab. Round toe.", "/images/item_images/FLAT_CHELSEA_BOOTS.jpg"),
(132, 18, "Corby Chino Short", 2, 50, "There's no going wrong with the classic Washed Chino Short. A relaxed fit, these mid-rise cotton shorts fall above the knee and don't skimp on comfort.", "/images/item_images/corby_chino_short.jpg"),
(133, 20, "French Terry Drawstring Cargo Shorts", 2, 34, "A pair of French Terry shorts featuring a drawstring waist and back patch, side cargo, and on-seam pockets.- Matching top available. Complete the look with 00476335.Content + Care- 88% cotton, 12% polyester- Machine wash coldSize + Fit- Model is 6'1' and wearing a Medium item code 00476336", "/images/item_images/French_Terry_Drawstring_Cargo_Shorts.jpg"),
(134, 13, "Rowan 2", 3, 155, "Rowan Zorilla Looks to the Future with His Second Signature Skate ShoeRowan Zorilla Rowan Zorillas loose, free-flowing style and uncanny ability to adapt to just about any spot has contributed to reshaping the way future generations think about skateboarding. With that in mind, Vans worked with Rowan to create the Rowan 2, an evolution of his first pro shoe with upgrades to both style and function to help Rowan continue pushing progression. The Rowan 2 takes its design cues from vintage court shoes and is built with ImpactWaffle technology—a combination of Vans’ VR3 dual-density impact cushioning and SickStick rubber, providing exceptional impact protection without sacrificing boardfeel. The Rowan 2 was designed with sustainability in mind and qualifies for Vans’ VR3 Checkerboard Globe Logo. Vans VR3 designation follows strict material guidelines with one or a combination of regenerative, responsibly sourced renewable, and recycled materials making up at least 30% of the product.", "/images/item_images/ROWAN_2.jpg"),
(135, 11, "Red Cat Leather Boots", 9, 44, " A statement-making footwear option, these red cat leather boots are sure to turn heads. The vibrant red hue is eye-catching and bold, while the playful cat motif adds a touch of whimsy. The sleek leather upper is both stylish and durable, while the sturdy heel provides both height and stability. Whether you're pairing them with jeans for a casual look or a dress for a more elevated ensemble, these boots are sure to make a lasting impression.", "/images/item_images/red_cat_leather_boots.jpg"),
(136, 15, "Nike Air Max Solo", 9, 165, "This modern interpretation of classic elements is perfect for the Air Max super-fan. Layer up in breathable mesh and plush synthetic leathers, with a heel cup inspired by the AM90. The AM180 influences the textured Air unit, which delivers just the right amount of cushioning. Go ahead—Max out your look.", "/images/item_images/Nike_Air_Max_Solo.jpg"),
(137, 17, "Cotton Bow Shirt", 6, 140, "Studio Collection. Crisp shirt in a cotton weave. With its striking bow detail, this is a modern take on a classic silhouette. The voluminous bow is detachable and is formed from a long strap that laces through loops on the collar stand and ties at the front. A stand-out piece with a timeless collar, concealed buttons down the front and a yoke at the back. Dropped shoulders and long sleeves with extra-wide, buttoned cuffs and a sleeve placket with a link button. Rounded hem. Longer at the back. Article number 1198826001 Length Regular length Sleeve Length Long sleeve Fit Regular fit Collar Turn-down collar Description White, Solid colour Collection H&M Studio Collection", "/images/item_images/Cotton_bow_shirt.jpg"),
(138, 3, "Dark Cargo Jeans", 2, 37, " A rugged and stylish pair of jeans, perfect for any man who wants to add a touch of edge to his look. The dark wash is both versatile and timeless, while the multiple pockets provide ample storage space. Whether you're dressing up for a night out or hitting the trails, these jeans are sure to keep you looking and feeling your best.", "/images/item_images/dark_cargo_jeans.jpg"),
(139, 17, "Teddy Jacket", 11, 35, "Jacket in soft teddy with a stand-up collar, zip down the front and yoke at the back. Dropped shoulders, long sleeves and open front pockets. Article number 1099675011 Length Regular length Sleeve Length Long sleeve Fit Loose fit Collar Stand-up collar Description Light beige, Solid colour Concept EVERYDAY FASHION", "/images/item_images/Teddy_Jacket.jpg"),
(140, 15, "Nike Sportswear Essential Women'S Slim-Fit Crop T-Shirt", 6, 49, "You reviewed, we listened. We updated the extra-soft jersey fabric on this slim-fitting tee to have a thicker, more durable feel for added comfort and coverage.", "/images/item_images/Nike_Sportswear_Essential_Women's_Slim-fit_Crop_T-Shirt.jpg"),
(141, 4, "Packout Hike Tights", 7, 52, " Built for durability and performance, Patagonia's Women's W's Pack Out Hike Tights are designed to withstand the rigors of any hike. The abrasion-resistant fabric is made from recycled materials, and the tights feature a gusseted crotch and articulated knees for freedom of movement. The tights also have multiple pockets for storing essentials, such as a phone, wallet, and keys.", "/images/item_images/packout_hike_tights.jpg"),
(142, 17, "Leather Pencil Skirt", 7, 370, "Studio Collection. Sleek pencil skirt in leather with a clean waistband and a slightly crinkled finish with a sheen. Narrow belt loops and zip fly with a concealed button and hook-and-bar fastener add to the skirt’s effortless feel. Figure-hugging fit and a chic, calf length hem. Visible seams and a high slit at the back of the hem. Welt back pocket. Lined. Article number 1199126001 Length Midi Waist Rise Regular waist Fit Slim fit Style Pencil skirt Description Midnight black, Solid colour Collection H&M Studio Collection Nice to know H&M Premium Selection", "/images/item_images/Leather_pencil_skirt.jpg"),
(143, 14, "Ny 90 Shoes White", 9, 129, "VERSATILE AND SPORTY SHOES MADE IN PART WITH RECYCLED MATERIALS. Retro sport style that's made with the planet in mind. Is it too good to be true? Nope, it's the adidas NY 90 shoes. They have the clean and classic look of court shoes from the '90s, but they're made in part with recycled materials as a better choice for the planet. A true union of past and future. Made with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.", "/images/item_images/NY_90_Shoes_White.jpg"),
(144, 19, "Heattech Pile Lined Sweat Full-Zip Hoodie", 5, 60, "Warm ‘HEATTECH’ on the outside, soft pile lining on the inside. Cut from a single piece of fabric for a sleek look.", "/images/item_images/HEATTECH_Pile_Lined_Sweat_Full-Zip_Hoodie.jpg"),
(145, 9, "Yellow Ribbon Blouse", 6, 16, " A feminine and stylish piece, the yellow ribbon blouse is a must-have for any wardrobe. The soft and flowing fabric is both comfortable and flattering, while the delicate ribbon detailing adds a touch of elegance. Whether you're pairing it with a skirt for a more formal look or jeans for a more casual ensemble, this blouse is sure to turn heads.", "/images/item_images/yellow_ribbon_blouse.jpg"),
(146, 16, "Faux Leather Puffer Jacket", 11, 119, "Puffer jacket with thermal insulation tested in the laboratory to withstand temperatures between 0ºC to -15ºC. High neck and long sleeves with inner elasticated cuffs. Side in-seam zip pockets. Adjustable hem with elasticated drawstrings and stoppers. Front zip and snap-button fastening.", "/images/item_images/FAUX_LEATHER_PUFFER_JACKET.jpg"),
(147, 14, "Zne Premium Shorts Grey", 2, 89, "EVERYDAY SHORTS MADE WITH A BLEND OF RECYCLED AND RENEWABLE MATERIALS. The adidas Z.N.E. collection reimagines daily essentials and makes them into premium pieces. With subdued looks and more neutral colours, these shorts bring the simplicity you need to regain balance. A drop crotch and loose fit give that laid-back feel. Moisture-absorbing AEROREADY ensures you stay dry, and a Z.N.E. graphic signs off the look. A minimum of 70% of this product is a blend of recycled and renewable material.", "/images/item_images/ZNE_Premium_Shorts_Grey.jpg"),
(148, 6, "Turquoise White Autumn Bomber Jacket", 11, 58, " A stylish and versatile turquoise and white autumn bomber jacket that is perfect for the changing seasons. The jacket features a relaxed fit, ribbed cuffs and hem, and a front zipper closure. The turquoise and white color block design is both eye-catching and timeless, while the bomber jacket style is both classic and modern. The jacket is perfect for layering over sweaters, dresses, or jeans, and it can be dressed up or down depending on the occasion. ", "/images/item_images/turquoise_white_autumn_bomber_jacket.jpg"),
(149, 19, "Heattech Crew Neck Short Sleeve T-Shirt", 1, 15, "Recommended for 5°C to 20°C*. High-performance base layer ensures comfort and warmth. Short sleeves with a streamlined fit.", "/images/item_images/HEATTECH_Crew_Neck_Short_Sleeve_T-Shirt.jpg"),
(150, 19, "Sweat Pants", 2, 30, "Soft and comfortable sweatpants. Side lines accentuate the silhouette for a sleek look.", "/images/item_images/Sweat_Pants.jpg"),
(151, 17, "Relaxed Fit Nylon Cargo Joggers", 2, 75, "Cargo joggers in nylon with covered elastication and a drawstring at the waist, diagonal side pockets, flap leg pockets with concealed press-studs, and a welt back pocket. Covered elastication and an adjustable hook and loop tab at the hems. Article number 1168883002 Length Long Waist Rise Regular waist Fit Relaxed fit Style Cargo, Joggers Description Khaki green, Solid colour", "/images/item_images/Relaxed_Fit_Nylon_cargo_joggers.jpg"),
(152, 19, "Denim Wide Straight Cargo Pants", 7, 60, "Wide cut makes a style statement. Comfortable mid-rise waist.", "/images/item_images/Denim_Wide_Straight_Cargo_Pants.jpg"),
