(230, 14, "Adidas Rekive Shorts Grey", 2, 99, "CASUAL FRENCH TERRY SHORTS FOR TOTAL COMFORT. Nothing but ease, that's what these adidas sweat shorts are serving up. It can't be helped since soft French terry immediately settles you into comfort. Piping alongside the signature 3-Stripes creates a slightly vintage aesthetic.", "/images/item_images/adidas_Rekive_Shorts_Grey.jpg"),
(231, 15, "Nike Solo Swoosh Men'S Fleece Trousers", 2, 135, "Celebrate the power and simplicity of the Swoosh. These soft, brushed-fleece trousers are made for comfort and laid-back, nostalgic style. They're roomy through the seat and thighs, then slightly taper to the cuffed ankle. A soft elastic waist and inner drawcord keeps them comfy where it counts, while the embroidered Swoosh on the left thigh gives you a clean, effortless finish.", "/images/item_images/Nike_Solo_Swoosh_Men's_Fleece_Trousers.jpg"),
