(235, 8, "Military Male Jogger Pants", 2, 21, " A stylish and comfortable pair of pants, perfect for any man who wants a rugged and versatile look. The military-inspired design is both eye-catching and timeless, while the jogger fit is both comfortable and flattering. These pants can be dressed up or down to suit any occasion.", "/images/item_images/military_male_jogger_pants.jpg"),
