(246, 7, "Slimfit Cotton-Padded Coat", 5, 25, " The Slimfit Cotton-Padded Coat is a stylish and versatile piece of outerwear that is perfect for the man who wants to stay warm and stylish all winter long. It is made from high-quality materials and features a slim fit that flatters all body types. The coat is also padded with cotton to provide excellent insulation, making it ideal for cold weather conditions. The Slimfit Cotton-Padded Coat is a stylish and versatile piece of outerwear that is perfect for the man who wants to stay warm and stylish all winter long. It is made from high-quality materials and features a slim fit that flatters all body types. The coat is also padded with cotton to provide excellent insulation, making it ideal for cold weather conditions.", "/images/item_images/slimfit_cotton-padded_coat.jpg"),
