(253, 15, "Women'S High-Waisted Wide-Leg Tracksuit Bottoms", 7, 105, "Rise up and transform your fleece wardrobe with strong cosy vibes. The extra-long wide leg and hem vents of these Phoenix Fleece trousers let you show off your favourite shoes, while taller ribbing at the waist and an exaggerated drawcord ensure your look is anything but basic.", "/images/item_images/Women's_High-Waisted_Wide-Leg_Tracksuit_Bottoms.jpg"),
