(256, 14, "Adicolor Essentials Tights", 7, 59, "CASUAL LEGGINGS FOR EVERYDAY STYLING. When you're sprawled out on the couch or sitting for hours at your desk, you don't want anything restrictive digging into you uncomfortably. You want these adidas tights. In fact, no matter what you're doing you want these adidas tights. Because they have that perfect stretch that wraps your legs in comfort, and that's always a good thing to feel. Plus their simplicity means full versatility — wear them however and with whatever you want.", "/images/item_images/ADICOLOR_ESSENTIALS_TIGHTS.jpg"),
