(270, 14, "Aeroready Essentials 3-Stripes Shorts", 2, 50, "EVERYDAY SHORTS THAT ARE READY FOR ANYTHING YOUR DAY THROWS AT 'EM. Hang out with the crew in style. The classic 3-Stripes give these adidas shorts a heritage sportswear feel that blends right in to your wardrobe. Stay comfortable with the soft, flexible elastic waist. A drawstring finishes things off for a secure fit. This product supports sustainable cotton farming and is made with recycled content. Both are part of our ambition to end plastic waste.", "/images/item_images/AEROREADY_Essentials_3-Stripes_Shorts.jpg"),
(271, 14, "Adidas Zne. Tee Grey", 6, 59, "A CROP T-SHIRT MADE WITH A BLEND OF RECYCLED AND RENEWABLE MATERIALS. At your desk or out in nature, keep distractions to a minimum so you can get in the zone and stay there. This figure-hugging adidas t-shirt is soft, stretchy and made with AEROREADY technology to manage your body's moisture and help you stay dry and comfortable. With its crop shape and high, ribbed collar, this tee teams well with joggers and jeans alike. A minimum of 70% of this product is a blend of recycled and renewable materials.", "/images/item_images/adidas_ZNE._Tee_Grey.jpg"),
