(274, 14, "Marathon 20 Shorts", 7, 50, "BREATHABLE RUNNING SHORTS MADE TO GO THE DISTANCE. Meet the workhorse of workout wear. Soft and breathable, these adidas running shorts are sporty and super comfortable. AEROREADY helps keep moisture off your skin and your mind on your run. Now you're ready for anything.", "/images/item_images/MARATHON_20_SHORTS.jpg"),
