(289, 14, "Train Icons 3-Stripes Training Pants Blue", 2, 99, "STRETCHY, MOISTURE-MANAGING PANTS MADE IN PART WITH RECYCLED MATERIALS. You love to train just about as much as you love to stay dry while doing it. These adidas training pants give you the best of both worlds, pairing soft, stretchy comfort with AEROREADY to manage moisture as your workout heats up. The mid-rise fit is supportive, and tapered legs keep your feet clear to move distraction free. Made with a series of recycled materials, and at least 70% recycled content, this product represents just one of our solutions to help end plastic waste.", "/images/item_images/Train_Icons_3-Stripes_Training_Pants_Blue.jpg"),
(290, 15, "Nike Court Vision Low Next Nature Men'S Shoes", 3, 89, "In love with the classic look of '80s basketball but have a thing for the fast-paced culture of today's game? Meet the Nike Court Vision Low. A classic remixed with at least 20% recycled materials by weight, its crisp upper and stitched overlays keep the soul of the original style. The plush, low-cut collar keeps it sleek and comfortable for your world.", "/images/item_images/Nike_Court_Vision_Low_Next_Nature_Men's_Shoes.jpg"),
(291, 3, "Lady Swing Lapel Coat Blue", 11, 43, " A classic and elegant lady swing lapel coat in a captivating shade of blue. The coat features a flattering silhouette that accentuates the wearer's figure, while the swing design adds a touch of movement and femininity. The lapel collar is both stylish and sophisticated, and the long sleeves provide warmth and coverage. The rich blue hue is both eye-catching and versatile, making it a perfect choice for a variety of occasions. ", "/images/item_images/lady_swing_lapel_coat_blue.jpg"),
