(297, 20, "Cropped Raw-Cut Denim Jacket", 11, 68, "A denim jacket featuring a boxy silhouette, distressing, buttoned flap chest pockets, button front closures, dropped shoulders, long sleeves, and a cropped raw-cut hem. Content + Care - 100% cotton - Machine wash cold Size + Fit - Model is 5'7' and wearing a Small Item code 00439662", "/images/item_images/Cropped_Raw-Cut_Denim_Jacket.jpg"),
(298, 13, "Color Theory Old Skool", 9, 105, "The Color Theory Collection allows you to create a unique color story by pairing vibrant, unexpected hues with our iconic footwear styles. Made with a classic pairing of canvas and suede, the Color Theory Old Skool honors our heritage Sidestripe silhouette while offering a fresh look that boosts the appeal of this unmistakable go-to shoe.", "/images/item_images/COLOR_THEORY_OLD_SKOOL.jpg"),
