(313, 11, "Plaid Drawstring Waist Shorts", 7, 37, " These stylish and comfortable shorts are perfect for any casual occasion. The plaid pattern is both classic and trendy, and the drawstring waist ensures a perfect fit. The shorts are made from a soft and lightweight fabric that is perfect for hot weather.", "/images/item_images/plaid_drawstring_waist_shorts.jpg"),
(314, 13, "Bmx Slip-On", 3, 106, "Specifically Designed with BMX in Mind The iconic Vans-style upper with DURACAP reinforcement, on top of our WAFFLECUP BMX outsole, gives the BMX Slip-On maximum pedalfeel and support . . . with timeless style. Inside the shoe, POPCUSH energy return sockliners offer superior cushioning and impact protection. Add in our Van Doren Factory Pedal Recipe for a specifically formulated gum rubber compound to enhance pedal grip and durability, and you’ve got unrivaled BMX innovation to support your progression. This signature slip-on BMX shoe is made with sturdy suede and 10 oz canvas uppers.", "/images/item_images/BMX_SLIP-ON.jpg"),
(315, 15, "Nike Phoenix Waffle", 9, 165, "All-day comfort meets all-day style. Taking cues from original Blue Ribbon Sports designs and incorporating the technological advances of today, the Phoenix Waffle rises from the ashes. A redesigned Waffle tread lightens the shoe, while the increased midsole height creates an even softer ride. Check the vintage Swoosh logo and archive-inspired tongue for a modern take on classic BRS looks.", "/images/item_images/Nike_Phoenix_Waffle.jpg"),
