(321, 10, "Hiking Pants (Green)", 7, 23, " These durable and versatile hiking pants are perfect for any outdoor adventure. The water-resistant fabric will keep you dry in light rain or mist, while the UPF 50+ sun protection will help keep your skin safe from harmful rays. The pants also feature multiple pockets for storing essentials, such as a phone, wallet, and keys.", "/images/item_images/hiking_pants_(green).jpg"),
(322, 7, "Satin High Heel Slides Pink", 9, 70, " A vision of elegance and sophistication, these satin high heel slides in pink are sure to make a statement. The luxurious satin upper shimmers with every step, while the sleek silhouette is both stylish and timeless. The high heel adds a touch of glamour, while the slide design makes them easy to slip on and off. Whether you're dressing up for a special occasion or adding a touch of luxury to your everyday look, these slides are sure to turn heads.", "/images/item_images/satin_high_heel_slides_pink.jpg"),
