(326, 13, "Range Baggy Taprd Acid Wash Cord Pant", 2, 99, "We created the Range Pant because we know that when your personal style is always on, you can never have an off session. The Range Baggy Tapered Corduroy Acid Wash Elastic Waist Pant gives you all the style, comfort, mobility, and skateability you need to make a personal statement on and off the board. Built around an easy pull-on elastic waist for all-day, everyday wear, this versatile pant features a long rise at the waist that stays baggy through the hip and thigh, ending in a tapered leg. The cotton corduroy fabrication offers a soft hand feel, while an allover wash and subtle brand details keep the style on point Drop-V bar tack embroidery at the side seam and pockets, a key loop on the right rear waistband, and a branded flag label sewn into the hem of the leg opening that’s visible when cuffed. Model is 6 feet tall and wearing a size Medium.", "/images/item_images/RANGE_BAGGY_TAPRD_ACID_WASH_CORD_PANT.jpg"),
(327, 20, "Faux Suede Trucker Jacket", 11, 65, "Details A faux suede trucker jacket featuring a basic collar, snap button-front closures, chest patch pockets, and dropped long sleeves with snap buttoned cuffs.Content + Care - 94% polyester, 6% spandex - Machine wash cold Size + Fit - Model is 5'8' and wearing a Small", "/images/item_images/Faux_Suede_Trucker_Jacket.jpg"),
