(331, 13, "Outdoors Tie Dye Short Sleeve Tee", 1, 59, "The Outdoors Tie Dye T-Shirt is a short sleeve crewneck tee made from a heavier weight cotton and features an allover tie dye wash, printed Vans logo on the front and holisitc remedies inspired graphic on the back.", "/images/item_images/OUTDOORS_TIE_DYE_SHORT_SLEEVE_TEE.jpg"),
