(354, 6, "Platform Oxford Shoes Black", 9, 23, " A classic and sophisticated footwear option, these platform oxford shoes in black are a must-have for any wardrobe. The elevated platform provides both height and style, while the sleek black hue is both timeless and versatile. Whether you're pairing them with a skirt for a formal look or jeans for a more casual ensemble, these shoes are sure to elevate your outfit.", "/images/item_images/platform_oxford_shoes_black.jpg"),
(355, 17, "Relaxed Fit Hoodie", 5, 65, "Hoodie in sweatshirt fabric with a soft brushed inside. Relaxed fit with a lined drawstring hood, kangaroo pocket, gently dropped shoulders, long sleeves and ribbing at the cuffs and hem. Article number 1074307003 Length Regular length Sleeve Length Long sleeve Fit Relaxed fit Style Hoodie Description White/Light turquoise/Light pink/Green/Dark red, Bulbasaur, Pokémon", "/images/item_images/Relaxed_Fit_Hoodie.jpg"),
(356, 7, "Wood Frameless Sunglasses", 10, 18, " These unique and stylish sunglasses feature a frameless design made from natural wood. The lenses are made from high-quality polycarbonate and provide excellent UV protection. The sunglasses are lightweight and comfortable to wear, and they come in a variety of wood types to suit your style.", "/images/item_images/wood_frameless_sunglasses.jpg"),
