(365, 4, "Green Autumn Casual Hooded Jacket", 5, 41, " The Green Autumn Casual Hooded Jacket is the perfect jacket for the man who wants to stay warm and stylish all fall long. It is made from high-quality materials and features a classic hooded design with a green-colored finish. The jacket also has a number of features that make it ideal for everyday wear, such as a water-resistant finish, multiple pockets, and a drawcord hem.", "/images/item_images/green_autumn_casual_hooded_jacket.jpg"),
