(367, 15, "Nike Hoops Elite Duffel Bag (57L)", 4, 85, "Wherever your game takes you, take the gear you need to succeed. The Nike Hoops Elite Duffel Bag has plenty of room for all the gear you need on and off the court, including a ventilated zipped bottom compartment to store your favourite pair of sneakers. Throw it onto your shoulder or grab the dual handles and get going to your favourite local court to swish that half-court shot.", "/images/item_images/Nike_Hoops_Elite_Duffel_Bag_(57L).jpg"),
