(371, 12, "Manfinity Chillmode Men Slogan & Cartoon Graphic Tee", 1, 10, "Color Beige Style Casual Pattern Type Cartoon, Slogan Neckline Round Neck Sleeve Length Short Sleeve Sleeve Type Drop Shoulder Length Regular Fit Type Oversized Fabric Medium Stretch Material Knitted Fabric Composition 100% Polyester Care Instructions Machine wash or professional dry clean Sheer No", "/images/item_images/Manfinity_Chillmode_Men_Slogan_&_Cartoon_Graphic_Tee.jpg"),
