(373, 14, "Pureboost 23 Shoes Grey", 9, 209, "ENERGY-RETURNING RUNNING SHOES MADE IN PART WITH RECYCLED MATERIALS. The more energy you put in, the more you get back. Built for everyday running, the adidas Pureboost 23 shoes feature full-length BOOST for energy return and strategic cutouts along the rubber outsole that let the foam compress and expand as you move. The lightweight engineered mesh upper is breathable where your foot heats up and supportive where it needs to be, resulting in an experience that will get you up and running in comfort. Made with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.", "/images/item_images/Pureboost_23_Shoes_Grey.jpg"),
(374, 13, "Denim Torrey", 5, 149, "Denim Torrey is made of 100% Cotton", "/images/item_images/DENIM_TORREY.jpg"),
