(378, 17, "Loose Fit Sweatpants", 2, 50, "Sweatpants in sweatshirt fabric with a soft brushed inside and a print motif. Loose fit with elasticated smocking and a concealed drawstring at the waist, welt pockets at the sides and covered elastication at the hems. Article number 1122662003 Size Inside leg Length 73.5 N/A (Size L/L) Length Long Waist Rise Regular waist Fit Loose fit Style Joggers, Sweatpants Description Black/Light green, Macrocosm", "/images/item_images/Loose_Fit_Sweatpants.jpg"),
(379, 18, "Micro Crop Tee", 6, 20, "The micro t-shirt is a serious wardrobe essential. A fitted crop that screams comfort, it pairs back perfectly with your fave denim. Pick it up in a range of trending colours for easy everyday styling.", "/images/item_images/Micro_Crop_Tee.jpg"),
(380, 14, "Canvas Tote Bag White", 10, 35, "A VERSATILE, CANVAS TOTE BAG FOR DAILY USE. Let us introduce you to your new do-everything and go-anywhere bag. While the size is on the smaller side, this adidas tote bag still provides plenty of room thanks to the wide-bottom design. It's ideal for everything from the gym to the store and off to the beach. A pocket at the front keeps essentials within easy reach. Our cotton products support more sustainable cotton farming.", "/images/item_images/Canvas_Tote_Bag_White.jpg"),
