(384, 18, "Baggy Jean", 2, 80, "Baggy is back. Do it your way with the Baggy Jean – an essential for nailing the laid-back look. Made from rigid denim that gets better with wear. If low-riders aren't your vibe, wear these with a belt for a slimmer fit.", "/images/item_images/baggy_jean.jpg"),
(385, 12, "Shein Ezwear Solid Ribbed Knit Tank Dress", 8, 10, "Color Apricot Style Casual Pattern Type Plain Details Rib-Knit Neckline Scoop Neck Type Tank Sleeve Length Sleeveless Waist Line Natural Hem Shaped Pencil Length Long Fit Type Slim Fit Fabric Slight Stretch Material Knitted Fabric Composition 96% Polyester, 4% Elastane Care Instructions Machine wash or professional dry clean Belt No Sheer No", "/images/item_images/SHEIN_EZwear_Solid_Ribbed_Knit_Tank_Dress.jpg"),
(386, 13, "Vans X Breana Skate Mini Tee", 6, 49, "Breana is a stand-out skateboarder, always pushing the boundaries of street skateboarding with both technical skill and unique style. Built to skate, but with style designed to look good off the board, the Breana Geering Skate Mini Tee features her detailed skeleton and snake graphic at the back and a logo at left chest to round out the iconic look.", "/images/item_images/VANS_X_BREANA_SKATE_MINI_TEE.jpg"),
