(388, 17, "Glass-Bead Earrings", 10, 25, "New Arrival Metal earrings decorated with strands of glass beads in various shapes and sizes. Article number 1210208001 Description Black/Transparent", "/images/item_images/Glass-bead_earrings.jpg"),
(389, 15, "Nike Sportswear Women'S T-Shirt", 6, 55, "Wrap yourself in comfortable organic cotton. Made with slightly dropped shoulders, the loose fit brings a relaxed, casual feel.", "/images/item_images/Nike_Sportswear_Women's_T-shirt.jpg"),
(390, 15, "Nike Air Max 90 Gore-Tex Men'S Shoes", 3, 249, "Lace up and feel the legacy. These AM90s will keep up with you on all your adventures thanks to a mix of GORE-TEX and mesh materials. Worn by presidents, revolutionised through collabs and celebrated through rare colourways, the Waffle sole, striking visuals and Nike Air cushioning keep it alive and well.", "/images/item_images/Nike_Air_Max_90_GORE-TEX_Men's_Shoes.jpg"),
