(393, 14, "Stan Smith Shoes Grey", 9, 159, "ICONIC ADIDAS STAN SMITH SHOES MADE IN PART WITH RECYCLED MATERIALS. Timeless, modern, goes with anything — just a few of the many ways the adidas Stan Smith shoes have been described over the decades. This version takes the cosy route, with a quilted tongue and soft synthetic leather upper for a flexible fit with a touch of luxe. Iconic design details make a strong appearance, including perforated 3-Stripes and a branded heel tab. Made with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.", "/images/item_images/Stan_Smith_Shoes_Grey.jpg"),
(394, 12, "Shein Mod Lace Up Front Cami Dress", 8, 12, "Color Mint Green Style Casual Pattern Type Plain Details Lace Up, Zipper, Grommet Eyelet Neckline Spaghetti Strap Type Cami Sleeve Length Sleeveless Waist Line High Waist Hem Shaped Flared Length Midi Fit Type Regular Fit Fabric Non-Stretch Material Woven Fabric Composition 100% Polyester Care Instructions Machine wash or professional dry clean Sheer No", "/images/item_images/SHEIN_MOD_Lace_Up_Front_Cami_Dress.jpg"),
(395, 14, "Adicross Anti 3 Putt Hoodie Black", 5, 120, "A GOLF HOODIE MADE IN PART WITH A BLEND OF RECYCLED AND RENEWABLE MATERIALS. When it comes to the Three Stripe Life, you're in. But three putts on the green to sink your ball? Nope. Let the world know what you think about that in this adidas golf hoodie. The cotton blend feels cosy when you pull it on to finish your round after the sun goes down. Wear it to the clubhouse afterwards and raise a toast to the tap-in. A minimum of 70% of this product is a blend of recycled and renewable materials.", "/images/item_images/Adicross_Anti_3_Putt_Hoodie_Black.jpg"),
(396, 14, "Pureboost 23 Shoes Grey", 3, 209, "ENERGY-RETURNING RUNNING SHOES MADE IN PART WITH RECYCLED MATERIALS. Logging daily miles is a delight in the adidas Pureboost 23 running shoes. Full-length BOOST provides the ultimate energy return, and strategic cutouts along the rubber outsole let the foam compress and expand while you run. The lightweight engineered mesh upper is breathable where your foot heats up and supportive where it needs to be, resulting in a running experience that is comfortable toe to heel. Made with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.", "/images/item_images/Pureboost_23_Shoes_Grey.jpg"),
(397, 17, "Teddy-Lined Slippers", 9, 55, "Slippers with soft teddy linings, adjustable foot straps and patterned soles. Article number 1194959001 Heel Height No heel Description Black, Solid colour", "/images/item_images/Teddy-lined_slippers.jpg"),
(398, 19, "Ultra Stretch Airism Sleeveless Dress", 8, 40, "Crisp fabric creates a lovely A-line silhouette. The comfortable feel of cotton.", "/images/item_images/Ultra_Stretch_AIRism_Sleeveless_Dress.jpg"),
(399, 19, "Stretch Fleece Print Mock Neck Long Sleeve T-Shirt", 1, 30, "Versatile mock neck for easy layering. Smooth fleece creates a sophisticated impression.", "/images/item_images/Stretch_Fleece_Print_Mock_Neck_Long_Sleeve_T-Shirt.jpg"),
(400, 2, "White Slim Fit Summer T-Shirt", 1, 48, " Looking for a stylish and comfortable t-shirt to wear all summer long? Look no further than the White Slim Fit Summer T-Shirt! This shirt is made from a soft and breathable fabric that will keep you cool and comfortable all day long. The slim fit design flatters the figure, and the white color is versatile and easy to match with other items in your wardrobe. The White Slim Fit Summer T-Shirt is perfect for a variety of occasions. You can wear it to the beach, the park, or out on the town. It's also a great choice for everyday wear.", "/images/item_images/white_slim_fit_summer_t-shirt.jpg"),
(401, 20, "Satin Mini Cami Dress", 8, 30, "A satin mini dress featuring cami straps, a straight-cut neckline and back, and a back keyhole with a self-tie closure. Content + Care - 97% polyester, 3% spandex - Machine wash cold Size + Fit - Model is 59' and wearing a Small Item code 00436671", "/images/item_images/Satin_Mini_Cami_Dress.jpg"),
(402, 15, "Women'S Crew-Neck French Terry Tunic", 11, 95, "Arm day? Rest day? Get-stuff-done day? Stay comfortable no matter what kind of day it is in this spacious tunic. Its midweight French terry fabric (with unbrushed loops on the inside) gives structure, breathability and softness—so it's just as ready for the gym as it is for the sofa.", "/images/item_images/Women's_Crew-Neck_French_Terry_Tunic.jpg"),
(403, 3, "Regular Straight Fit Jeans", 2, 38, " A classic and versatile pair of jeans that is flattering on most body types. The straight leg provides a relaxed and comfortable fit, while the regular rise sits just below the waist. These jeans can be dressed up or down to suit any occasion.", "/images/item_images/regular_straight_fit_jeans.jpg"),
(404, 18, "Oversized Music Sweater", 5, 60, "Main 80% Cotton, 20% Polyester.", "/images/item_images/oversized_music_sweater.jpg"),
(405, 13, "Skate Era", 3, 99, "All New Skate Classics Built Extra Tough on the Inside For Skateboarding Completely redesigned for modern skateboarding, the all-new Skate Classics collection delivers more of what skateboarders need to enable maximum progression. The repositioned DURACAP reinforced underlays and fully redesigned uppers, combined with a new two-part foxing tape that features a deeper knurl pattern on the toe, make the new Skate Era durable enough to withstand daily skateboarding abuse. For more board control, the new molded heel counter and internal tongue straps lock in your feet. Even the gum rubber sole that made Vans famous has been elevated with the SICKSTICK rubber compound to deliver more grip and boardfeel. Plus, POPCUSH energy return sockliners provide superior cushioning and impact protection while helping to lessen leg fatigue for longer skate sessions. Internal heel stiffeners have also been added to provide more support and stability. The new Skate Eras updated foxing tape, along with sturdy suede and a mix of 6 oz and 10 oz canvas uppers, gives you the iconic look you want while bringing all the performance benefits skateboarders demand. And be sure to look for the new checkerboard flag on the side to guarantee that youÕre getting the best in style and modern skateboarding performance.", "/images/item_images/SKATE_ERA.jpg"),
(406, 15, "Nike Storm-Fit Adv Apex Bucket Hat", 4, 59, "This mid-depth Apex bucket hat is ready to lock up your look, whatever the weather throws your way. A seam-sealed and waterproof design helps keep the moisture where it belongs—on the outside. Tightening the detachable drawcord is easy, making finding the fit and feel you want even easier.", "/images/item_images/Nike_Storm-FIT_ADV_Apex_Bucket_Hat.jpg"),
