(410, 14, "Aeroready Hyperglam Tank Top White", 6, 59, "A SOFT AND STRETCHY TANK MADE IN PART WITH RECYCLED MATERIALS. The latest adidas Hyperglam collection is all about self-expression, letting you do your thing with style that represents you. This tank top keeps things casual and laid-back with a fit that's not too loose and not too tight for freedom of movement. AEROREADY manages your body's moisture to keep you dry, and 3-Stripes hit each side at an angle for unmistakable adidas energy. Made with a series of recycled materials, and at least 70% recycled content, this product represents just one of our solutions to help end plastic waste.", "/images/item_images/AEROREADY_Hyperglam_Tank_Top_White.jpg"),
