(412, 15, "Nike Air Max 90 Futura Se", 9, 239, "This special edition Air Max 90 Futura is party-ready. Sawtooth edging around the toe and a partially floating Swoosh deliver crafted luxury while iridescent overlays bring on the fun. Of course, our trusted Nike Air cushioning keeps you comfortable all day long. It's playful, sporty and whatever else you want it to be.", "/images/item_images/Nike_Air_Max_90_Futura_SE.jpg"),
