(419, 4, "Black Fur Leather Jacket", 5, 54, " A black fur leather jacket is a timeless and versatile piece of outerwear that is perfect for any occasion. It is made from high-quality leather and fur, and is sure to keep you warm and stylish all winter long. The jacket features a classic bomber style with a fur-lined collar and cuffs. It also has two front zipper pockets and one interior pocket, so you can easily store your belongings. The jacket is available in a variety of sizes to fit any man.", "/images/item_images/black_fur_leather_jacket.jpg"),
(420, 17, "Graphic-Print Pleated Dress", 8, 200, "Studio Collection. Loose-fit dress in a soft crêpe weave with an all-over graphic print that stands out from the crowd. Straight-cut silhouette with a seam at the waist and a pleated skirt in two layers of different lengths. Stand-up collar with extra-long ties and an opening with a covered button. Yoke at the front and back with gathers on the front. Long sleeves with gently flared, pleated cuffs. Unlined. Article number 1195208002 Length Long Sleeve Length Long sleeve Fit Loose fit Collar Stand-up collar Description Cream/Midnight black, Patterned, Teardrops Collection H&M Studio Collection", "/images/item_images/Graphic-print_pleated_dress.jpg"),
(421, 3, "Bear Paw Pink Slippers", 9, 65, " Bear Paw Pink Slippers are cozy and stylish slippers that are perfect for keeping your feet warm and comfortable. The slippers are made from soft faux fur and feature a sheepskin lining that provides warmth and comfort. The slippers have a durable rubber sole that provides traction and prevents slipping. Bear Paw Pink Slippers are a great choice for anyone who wants a comfortable and stylish pair of slippers. The slippers are perfect for lounging around the house, running errands, or even going out for a walk. The slippers are sure to keep your feet warm and comfortable all day long.", "/images/item_images/bear_paw_pink_slippers.jpg"),
(422, 15, "Nike Dunk Low Se", 9, 189, "From the hardwood to the streets to the World Wide Web. These classic sneakers get an Internet-inspired refresh with holographic accents. Jewel-like hardware and a special JDI dubrae add the finishing touch.", "/images/item_images/Nike_Dunk_Low_SE.jpg"),
(423, 6, "Fine Gray Oversized Parka Winter Jacket", 11, 69, " A sophisticated and elegant fine gray oversized parka winter jacket that is perfect for the coldest days. The jacket features a relaxed fit, a faux fur-lined hood, and long sleeves. The fine gray color is both timeless and versatile, while the oversized silhouette is both stylish and comfortable. The jacket is perfect for layering over sweaters, dresses, or jeans, and it is sure to keep you warm in even the most frigid temperatures. ", "/images/item_images/fine_gray_oversized_parka_winter_jacket.jpg"),
(424, 19, "Ultra Stretch Jeans", 2, 60, "High stretch and recovery rate for incredible comfort. The perfect skinny fit.", "/images/item_images/Ultra_Stretch_Jeans.jpg"),
(425, 8, "Orange Pyjama Stop", 6, 46, " A cozy and comfortable piece, the orange pyjama top is a must-have for any woman who loves to relax in style. The soft and breathable fabric is perfect for lounging around the house, while the cheerful orange hue is sure to brighten up your day. Whether you're pairing it with pyjama bottoms for a complete set or wearing it with jeans for a more casual look, this top is sure to become a favorite.", "/images/item_images/orange_pyjama_stop.jpg"),
(426, 15, "Nike Vomero 5 Men'S Shoes", 3, 249, "The Vomero 5 takes early-2000s running to modern heights. A combination of breathable and durable materials stands ready for the rigours of your day, while Zoom Air cushioning delivers a smooth ride.", "/images/item_images/Nike_Vomero_5_Men's_Shoes.jpg"),
(427, 19, "Cotton Tiered Camisole Dress", 8, 40, "Casual fabric great for at home or out and about. Stylish tiered design.", "/images/item_images/Cotton_Tiered_Camisole_Dress.jpg"),
(428, 10, "Dreams Butterfly Shorts", 7, 39, " These dreamy and whimsical shorts are perfect for adding a touch of magic to your wardrobe. The delicate butterfly print is both eye-catching and flattering, and the flowy fabric is perfect for hot summer days. The shorts feature a comfortable elastic waist and a flirty hemline.", "/images/item_images/dreams_butterfly_shorts.jpg"),
(429, 4, "Light Green Prom Dress", 8, 63, " A stunning light green prom dress that is sure to make you feel like a princess. The dress features a fitted bodice with a sweetheart neckline, a flowing skirt with a high-low hem, and delicate beading throughout. The light green color is both flattering and eye-catching, and the beading adds a touch of glamour. This dress is perfect for any prom or formal event.", "/images/item_images/light_green_prom_dress.jpg"),
(430, 17, "Joggers", 7, 40, "Loose-fit joggers in sweatshirt fabric with a soft brushed inside. Covered elastication and a concealed drawstring at the waist, discreet pockets in the side seams and covered elastication at the hems. Article number 1206292002 Length Long Waist Rise Regular waist Fit Loose fit Style Joggers Description White, Athletic club, sport, est 1998, Solid colour Concept BASICS, DIVIDED", "/images/item_images/Joggers.jpg"),
(431, 17, "Hi-Top Trainers", 3, 90, "Hi-top trainers in a hard-wearing ripstop weave with lacing at the front and loops at the back. Piqué linings and insoles, and soles that are patterned underneath. Height of soles 4.1 cm. Article number 1200455001 Heel Height No heel Footwear Style Trainers Description Black, Solid colour", "/images/item_images/Hi-top_trainers.jpg"),
(432, 10, "Tifanny Silver Watch", 10, 61, " A timeless and elegant timepiece, the Tiffany Silver Watch is a must-have for any woman's wardrobe. The sleek and sophisticated design features a polished silver case and a white mother-of-pearl dial with Roman numerals. The watch is powered by a precise quartz movement and is water resistant up to 30 meters. The Tiffany Silver Watch is the perfect accessory for any woman who wants a watch that is both stylish and functional.", "/images/item_images/tifanny_silver_watch.jpg"),
(433, 11, "Light Washed Denim Skinny Jeans", 2, 25, " A classic and versatile pair of jeans, perfect for any man's wardrobe. The light wash is both stylish and timeless, while the skinny fit is flattering on most body types. These jeans can be dressed up or down to suit any occasion.", "/images/item_images/light_washed_denim_skinny_jeans.jpg"),
(434, 20, "Slim-Fit Cargo Jeans", 2, 70, "A pair of slim-fit jeans featuring belt loops, slant front pockets, cargo flap front and back pockets, and belt loops. Content + Care - 99% cotton, 1% spandex - Machine wash warm Size + Fit - Model is 6'0' and wearing a Size 32 item code 00458405", "/images/item_images/Slim-Fit_Cargo_Jeans.jpg"),
(435, 14, "Run It Running Tee Red", 6, 50, "A LIGHTWEIGHT RUNNING TEE MADE WITH RECYCLED MATERIALS. There's nothing quite like the feeling of freedom running gives you. Eliminate distractions and enjoy the journey in this minimalist adidas tee. Moisture-absorbing AEROREADY lets you go the distance while feeling dry and comfortable. All-around reflectivity shines when the light fades. Made with 100% recycled materials, this product represents just one of our solutions to help end plastic waste.", "/images/item_images/Run_It_Running_Tee_Red.jpg"),
(436, 13, "Men Skate Authentic", 3, 49, "All New Skate Classics Built Extra Tough on the Inside For Skateboarding Completely redesigned for modern skateboarding, the all-new Skate Classics collection delivers more of what skateboarders need to enable maximum progression. The repositioned DURACAP reinforced underlays and fully redesigned uppers, combined with a new two-part foxing tape that features a deeper knurl pattern on the toe, make the new Skate Authentic durable enough to withstand daily skateboarding abuse. For more board control, the new molded heel counter and internal tongue straps lock in your feet. Even the gum rubber sole that made Vans famous has been elevated with the SICKSTICK rubber compound to deliver more grip and boardfeel. Plus, POPCUSH energy return sockliners provide superior cushioning and impact protection while helping to lessen leg fatigue for longer skate sessions. Internal heel stiffeners have also been added to provide more support and stability. The new Skate Authentics updated foxing tape and sturdy suede and 10 oz canvas uppers give you the iconic look you want while bringing all the performance benefits skateboarders demand. And be sure to look for the new checkerboard flag on the side to guarantee that youÕre getting the best in style and modern skateboarding performance.", "/images/item_images/MEN_SKATE_AUTHENTIC.jpg"),
(437, 17, "Beaded Square-Neck Crop To", 6, 55, "Crop top in an airy viscose weave with beads arranged as beautiful flowers. Square neckline, wide shoulder straps, boning at the front and concealed silicone tape at the top. Covered elastication and a concealed hook-and-eye fastening at the back. Lined. Article number 1205483001 Size The model is 174cm/5'9' and wears a size 36 Length Cropped Sleeve Length Sleeveless Fit Regular fit Style Crop top, Vest top Neckline Square neckline Description Beige Concept EVERYDAY FASHION", "/images/item_images/Beaded_square-neck_crop_top.jpg"),
