(443, 12, "Manfinity Homme Men 1Pc Solid Button Front Shacket", 5, 20, "Color Black Style Casual Pattern Type Plain Details Button Front Neckline Collar Sleeve Length Long Sleeve Sleeve Type Regular Sleeve Length Regular Placket Single Breasted Fit Type Regular Fit Fabric Non-Stretch Material Fabric Composition 100% Polyester Temperature Spring/Fall (18-25℃/63-77℉) Sheer No", "/images/item_images/Manfinity_Homme_Men_1pc_Solid_Button_Front_Shacket.jpg"),
