(445, 14, "Adidas Originals X Kseniaschnaider Denim Jacket", 11, 189, "A COTTON DENIM JACKET CO-DESIGNED WITH KYIV-BASED KSENIASCHNAIDER. The adidas Originals x KSENIASCHNAIDER collection demonstrates that honesty, clarity and humour are the keys to authentic and sophisticated design. This denim jacket is the perfect blend of that modern ethos and adidas style. It's got understated tonal 3-Stripes down the sleeves, plus snap details for a polished look. The loose fit lets you comfortably layer a tee, sweatshirt or both underneath. The cotton in this product has been sourced through Better Cotton. Better Cotton is sourced via a chain of custody model called mass balance. This means that Better Cotton is not physically traceable to end products.", "/images/item_images/adidas_Originals_x_KSENIASCHNAIDER_Denim_Jacket.jpg"),
