(450, 15, "Nike Air More Uptempo '96 Men'S Shoes", 3, 269, "Bold, eye-catching and all about the AIR. The Nike Air More Uptempo '96 refreshes an original that has reigned supreme for more than 20 years. With a design inspired by high-flying basketball style and '90s graffiti art, these kicks can't help but turn heads off court. Plus, Air units in the heel, forefoot and midfoot provide comfortable cushioning, so you feel as good as you look.", "/images/item_images/Nike_Air_More_Uptempo_'96_Men's_shoes.jpg"),
