(518, 16, "Technical Training Cap", 4, 50, "Cap made of lightweight, stretchy technical fabric. Featuring a printed logo.", "/images/item_images/TECHNICAL_TRAINING_CAP.jpg"),
(519, 19, "Faux Leather Round Shoulder Ba", 10, 50, "Features a larger capacity than the viral Round Mini Shoulder Bag. Padded for an airy texture. A wide gusset provides plenty of storage.", "/images/item_images/Faux_Leather_Round_Shoulder_Bag.jpg"),
(520, 15, "Jordan Dri-Fit Sport Men'S Full-Zip Hoodie", 5, 139, "Whether you're playing a game or cheering from the stands watching one, you're good to go in this full-zip hoodie. It's made from sweat-wicking material so you stay feeling fresh. And with that all-over elephant print, do we need to say anything else?", "/images/item_images/Jordan_Dri-FIT_Sport_Men's_Full-Zip_Hoodie.jpg"),
(521, 6, "V-Neck Green Dress", 8, 52, " A sophisticated and elegant V-neck green dress that exudes timeless style. The dress features a flattering silhouette that accentuates the wearer's figure, while the V-neckline adds a touch of allure. The rich green hue is both eye-catching and versatile, making it a perfect choice for a variety of occasions.", "/images/item_images/v-neck_green_dress.jpg"),
(522, 13, "Authentic Chino Loose Pant", 2, 109, "We put a lot of thought into our pants, so you dont have to. A versatile chino pant that delivers style and functionality at an affordable price, the Authentic Chino Loose Pant lets you stop worrying about your gear and focus on your skating. Built with a workwear fabrication, this loose chino pant features classic chino front hand pockets with a new coin pocket placement on the right, rear welt pockets with button closures, and embroidered Drop V bartacks for reinforcement. Plus, new details bring plenty of Off The Wall style to this skate essential, including the new V belt loop detail on the back waistband, the new checkerboard twill taping on the internal fly facing, and the new flag label sewn internally to the hem seam for added branding when legs are cuffed. Model is 6 feet tall and wearing a size 32.", "/images/item_images/AUTHENTIC_CHINO_LOOSE_PANT.jpg"),
(523, 7, "Sky Blue Jacket Laces Design", 11, 45, " A captivating sky blue jacket adorned with intricate lace detailing. The jacket features a flattering silhouette that accentuates the wearer's figure, while the lace design adds a touch of femininity and sophistication. The sky blue hue evokes feelings of serenity and confidence, making it a perfect choice for any special occasion. ", "/images/item_images/sky_blue_jacket_laces_design.jpg"),
(524, 8, "Light Blue Cloudy Dress", 8, 39, " A dreamy and ethereal light blue dress with a cloudy print. The dress features a flowing silhouette, delicate ruffles, and a soft and airy fabric. The cloudy print is reminiscent of a summer sky, adding a touch of whimsy and romance. The dress is perfect for any special occasion or for adding a touch of magic to your everyday life.", "/images/item_images/light_blue_cloudy_dress.jpg"),
(525, 11, "Blue Elastic Waist Jeans", 7, 26, " These stylish and comfortable jeans are perfect for everyday wear. The blue wash is both classic and versatile, and the elastic waist ensures a comfortable fit. The jeans are made from a high-quality denim that is both durable and stylish.", "/images/item_images/blue_elastic_waist_jeans.jpg"),
(526, 12, "Honeyspot Solid Wide Leg Jeans", 7, 33, "Color Medium Wash Pattern Type Plain Type Wide Leg Closure Type Zipper Fly Details Button, Pocket, Zipper Waist Line High Waist Length Long Fit Type Loose Fabric Non-Stretch Material Denim Composition 85.8% Rayon, 9.8% Viscose, 4.4% Polyester Care Instructions Machine wash or professional dry clean Pockets Yes Body Unlined Sheer No", "/images/item_images/Honeyspot_Solid_Wide_Leg_Jeans.jpg"),
(527, 14, "Duramo Speed Shoes White", 9, 119, "RUNNING SHOES MADE IN PART WITH RECYCLED MATERIALS. A combination of a lightweight & breathable engineered mesh upper with a full length LIGHTSTRIKE midsole for faster movement and durable outsole was built for runners looking to learn the ropes and push themselves to the next level. Made with a series of recycled materials. This product represents just one of our solutions to help end plastic waste.", "/images/item_images/Duramo_Speed_Shoes_White.jpg"),
(528, 12, "Women Point Toe Sculptural Heeled Slingback Pumps", 9, 22, "Color Khaki Type Slingbacks Style Elegant Toe Point Toe Pattern Type Plain Strap Type Slingbacks Heels Sculptural Heels Heel Height Mid Heel (7.5cm/3inch) Upper Material PU Leather Lining Material PU Leather", "/images/item_images/Women_Point_Toe_Sculptural_Heeled_Slingback_Pumps.jpg"),
(529, 19, "Sweat Turtleneck Long Sleeve Shirt", 5, 60, "Versatile relaxed fit. Sweat material, brushed on the inside for warmth and comfort.", "/images/item_images/Sweat_Turtleneck_Long_Sleeve_Shirt.jpg"),
(530, 20, "Strappy Cropped Tee", 6, 25, "A knit cropped tee featuring short sleeves, a crew neck, and strap at the midsection with a high-polish lobster clasp detail. Content + Care - 100% cotton - Machine wash cold Size + Fit - Model is 5'8.5' and wearing a Small Item code 00457614", "/images/item_images/Strappy_Cropped_Tee.jpg"),
(531, 17, "Wide Trousers", 7, 75, "Tailored trousers in woven fabric with concealed elastication at the waist and a concealed zip at one side. Diagonal side pockets, fake welt pockets at the back and wide, straight legs with pleats at the top. Article number 1191215001 Length Long Waist Rise Regular waist Fit Loose fit Style Straight leg, Suit trousers Description Black, Solid colour Concept MODERN CLASSIC", "/images/item_images/wide_trousers.jpg"),
(532, 12, "Elegant Beige Sandals For Women", 9, 10, "Type Slides Color Beige Style Vacation Pattern Type Plain Toe Open Toe Details Braid Upper Material PU Leather Lining Material Microfiber Leather Insole Material Microfiber Leather Outsole Material Rubber", "/images/item_images/Elegant_Beige_Sandals_For_Women.jpg"),
(533, 11, "Chunky Thick Sole Casual Footwear", 9, 32, " `Chunky thick sole casual footwear is a trendy and stylish option that is perfect for everyday wear. The chunky sole provides both comfort and style, while the casual design can be dressed up or down. This type of footwear is perfect for pairing with jeans, leggings, or skirts, and can be accessorized with a variety of different items.", "/images/item_images/chunky_thick_sole_casual_footwear.jpg"),
(534, 15, "Nike Acg Men'S Trail Trousers", 2, 129, "The Nike ACG Trail Trousers are ready for whatever your outdoor adventure throws at you. A water-repellent finish combines with a tough, abrasion-resistant design to keep you moving through wet and rocky trails. This product is made from at least 75% recycled polyester and recycled nylon fibres.", "/images/item_images/Nike_ACG_Men's_Trail_Trousers.jpg"),
(535, 2, "Green Cotton V Neck Shirt", 1, 45, " Add a touch of style to your wardrobe with this green cotton V neck shirt. Made from soft and breathable cotton fabric, this shirt is perfect for all-day comfort. The V-neckline adds a touch of sophistication, while the green color is both versatile and trendy. This shirt can be dressed up or down, making it perfect for any occasion. For a casual look, pair it with jeans or shorts and sneakers. For a more dressed-up look, pair it with chinos or slacks and dress shoes. No matter how you style it, this shirt is sure to turn heads.", "/images/item_images/green_cotton_v_neck_shirt.jpg"),
(536, 19, "Draped Short Sleeve Dress", 8, 60, "Elegant drape for a stunning style. With handy side pockets.", "/images/item_images/Draped_Short_Sleeve_Dress.jpg"),
(537, 17, "Oversized Printed T-Shirt", 6, 25, "Oversized T-shirt in soft, printed cotton jersey with a ribbed trim around the neckline and dropped shoulders. Article number 1163102021 Size The model is 175cm/5'9' and wears a size S Length Regular length Sleeve Length Short sleeve Fit Oversized Neckline Round neck Description Black/White, Striped Concept DIVIDED, H&M+", "/images/item_images/Oversized_printed_T-shirt.jpg"),
(538, 7, "Grey Winter Coat", 5, 64, " The Grey Winter Coat is the perfect jacket for the man who wants to stay warm and stylish all winter long. It is made from high-quality materials and features a classic design with a grey-colored finish. The coat also has a number of features that make it ideal for everyday wear, such as a water-resistant finish, a removable hood, and multiple pockets.", "/images/item_images/grey_winter_coat.jpg"),
(539, 3, "Crrju Gold Opal Watch", 4, 29, " A luxurious and eye-catching timepiece, the Crrju Gold Opal Watch is sure to turn heads. The stunning opal dial is set in a gold-plated case, creating a truly unique and elegant look. The watch is powered by a high-quality quartz movement, ensuring accurate timekeeping. Whether you're dressing up for a formal event or adding a touch of luxury to your everyday look, this watch is sure to make a statement.", "/images/item_images/crrju_gold_opal_watch.jpg"),
(540, 19, "Italian Leather Smooth Stitched Belt", 4, 40, "Carefully selected fabrics and manufacturing process for an authentic finish. Sleek design with detailed stitching.", "/images/item_images/Italian_Leather_Smooth_Stitched_Belt.jpg"),
(541, 6, "Matt Relaxed Fit Jeans", 2, 63, " A comfortable and stylish pair of jeans, perfect for any man who wants a relaxed and effortless look. The relaxed fit is flattering on most body types, and the jeans are made from a soft and comfortable denim fabric. These jeans can be dressed up or down to suit any occasion.", "/images/item_images/matt_relaxed_fit_jeans.jpg"),
(542, 16, "Textured Top", 6, 50, "Drop sleeve top with a mock neck and textured fabric detail.", "/images/item_images/TEXTURED_TOP.jpg"),
(543, 15, "Nike Air Force 1 '07", 9, 169, "The radiance lives on in the Nike Air Force 1 '07, the b-ball icon that puts a fresh spin on what you know best crisp leather, bold colours and the perfect amount of flash to make you shine.", "/images/item_images/Nike_Air_Force_1_'07.jpg"),
(544, 20, "Ruched Drawstring Mini Dress", 8, 28, "A knit mini dress featuring ruched drawstring sides, a sleeveless cut, round neckline, and a bodycon silhouette. Content + Care - 54% cotton, 37% polyester, 9% spandex - Machine wash cold Size + Fit - Model is 59' and wearing a Small Item code 00438966", "/images/item_images/Ruched_Drawstring_Mini_Dress.jpg"),
(545, 7, "Sweatshorts Coal Black", 2, 46, " A comfortable and stylish pair of shorts, perfect for lounging around or working out. The coal black color is both versatile and timeless, while the shorts can be dressed up or down to suit any occasion.", "/images/item_images/sweatshorts_coal_black.jpg"),
(546, 5, "Yellow Short Sleeved T-Shirt", 6, 22, " A classic and versatile piece, the yellow short sleeved t-shirt is a must-have for any wardrobe. The sunny yellow hue is both cheerful and sophisticated, while the soft cotton fabric is both comfortable and stylish. Whether you're pairing it with jeans for a casual look or a skirt for a more elevated ensemble, this t-shirt is sure to elevate your outfit.", "/images/item_images/yellow_short_sleeved_t-shirt.jpg"),
(547, 19, "Peg Jeans", 7, 60, "Deep tucks create a flattering peg top style. Sleek high-waist.", "/images/item_images/Peg_Jeans.jpg"),
(548, 18, "Utility Trucker Jacket", 5, 110, "Zip closures Long sleeves Collar stand Double chest pockets", "/images/item_images/Utility_Trucker_Jacket.jpg"),
(549, 2, "Geneva Watch", 4, 51, " A symbol of Swiss watchmaking excellence, the Geneva Watch is a must-have for any man who appreciates fine craftsmanship. With its sleek and sophisticated design, this watch is sure to make a statement. The high-quality materials and construction ensure that this watch will last for years to come.", "/images/item_images/geneva_watch.jpg"),
(550, 11, "Pink Linen Blouse", 6, 38, " A timeless and elegant piece, the pink linen blouse is a must-have for any wardrobe. The natural linen fabric is both breathable and stylish, while the soft pink hue is both feminine and sophisticated. Whether you're pairing it with trousers for a formal look or jeans for a more casual ensemble, this blouse is sure to elevate your outfit.", "/images/item_images/pink_linen_blouse.jpg"),
(551, 18, "Urban Jogger", 2, 70, "Ooze urban vibes in this drop crotch jogger. Dyed with enzyme wash for a worn-out vintage look, this pant is big on details, without compromising comfort. Throw a crew neck into the mix to bring it all together.", "/images/item_images/urban_jogger.jpg"),
(552, 20, "Knit Stretch-Denim Skinny Jeans", 2, 55, "Crafted from stretch denim, this pair of skinny jeans features a stone wash, whiskering, mid-rise waist, belt loops, zip fly and button-front closure, and five-pocket construction. Content + Care - 63% cotton, 29% polyester, 7% rayon, 1% spandex - Machine wash cold Size + Fit - Model is 6'2.5'", "/images/item_images/Knit_Stretch-Denim_Skinny_Jeans.jpg"),
(553, 18, "Organic Regular Fit Crew T-Shirt", 1, 25, "Made with sustainably sourced organic cotton, this classic crewneck t-shirt is a cornerstone for any staple wardrobe. We’ve improved the fit, increased the fabric by 20gsm and each tee is pre-shrunk, rested and washed to hold its shape for longer.", "/images/item_images/Organic_Regular_Fit_Crew_T-Shirt.jpg"),
(554, 19, "Dry Stretch Sweat Long Sleeve Full-Zip Hoodie", 5, 60, "Updated with a matte texture. Now with even more stretch.", "/images/item_images/Dry_Stretch_Sweat_Long_Sleeve_Full-Zip_Hoodie.jpg"),
(555, 16, "Lace-Up Leather Flatform Ankle Boots", 9, 169, "Leather ankle boots. Flatform soles. Round toe. Lace-up fastening.", "/images/item_images/LACE-UP_LEATHER_FLATFORM_ANKLE_BOOTS.jpg"),
(556, 17, "Fuzzy Jacket", 11, 300, "Studio Collection. Fabulous jacket in supersoft fuzzy fabric – an eye-catching addition to your wardrobe. Straight cut with shoulder pads and exaggerated notch lapels, combined with minimalistic attributes in the form of concealed hook-and-eye-fasteners at the front and discreet front pockets. Welt inner pocket. Lined. Article number 1199083001 Length Regular length Sleeve Length Long sleeve Fit Regular fit Collar Notch lapel Description Cream, Solid colour Collection H&M Studio Collection", "/images/item_images/fuzzy_jacket.jpg"),
(557, 8, "Titanium Ring", 4, 70, " A durable and stylish choice for men's jewelry, the titanium ring is a popular option for wedding bands, promise rings, and everyday wear. Titanium is a strong and lightweight metal that is resistant to corrosion and scratches, making it a good choice for active men. Titanium rings are also hypoallergenic, making them a good option for men with sensitive skin.", "/images/item_images/titanium_ring.jpg"),
(558, 5, "Male Boat Shoe", 3, 55, " Male boat shoes are a classic and versatile type of shoe that is perfect for a variety of occasions. They are made with a soft, canvas or leather upper and a non-slip rubber sole. Boat shoes are typically lace-up, but there are also slip-on styles available.", "/images/item_images/male_boat_shoe.jpg"),
(559, 15, "Women'S Mid-Rise 7-8 Running Trousers", 7, 99, "Move with ease in these lightweight, sweat-wicking trousers that provide the perfect balance of room and stretch. Tapered legs allow you to run without distraction, while pockets let you stash your essentials. Plus, mesh panels behind the knees give you airflow when your miles heat up.", "/images/item_images/Women's_Mid-Rise_7-8_Running_Trousers.jpg"),
(560, 15, "Nike Gamma Force", 9, 145, "Layers upon layers of dimensional style—that's a force to be reckoned with. Offering both comfort and versatility, these kicks are rooted in heritage basketball culture. Collar materials pay homage to vintage sport while the subtle platform elevates your look, literally. The Gamma Force is forging its own legacy court style that can be worn all day, wherever you go.", "/images/item_images/Nike_Gamma_Force.jpg"),
(561, 18, "Girlfriend Denim Jacket", 11, 60, "Everyone needs a classic jean jacket, and the Girlfriend Denim Jacket is it. An authentic vintage look, this jacket is slightly cropped to layer. Made from rigid denim to stand the test of time. It gets better with every wear. Product Code 2001752-39", "/images/item_images/Girlfriend_Denim_Jacket.jpg"),
(562, 12, "Flap Pocket Cargo Pants", 7, 15, "Color Khaki Style Casual Pattern Type Plain Type Cargo Pants Closure Type Elastic Waist Details Pocket Waist Line High Waist Length Long Fit Type Regular Fit Fabric Non-Stretch Material Fabric Composition 100% Polyester Care Instructions Machine wash or professional dry clean Temperature Spring/Fall (18-25℃/63-77℉) Body Unlined Sheer No", "/images/item_images/Flap_Pocket_Cargo_Pants.jpg"),
(563, 13, "Zahba", 3, 149, "Zahba Leather", "/images/item_images/ZAHBA.jpg"),
(564, 18, "Clip Belt", 4, 20, "Walk the streets in style with our Clip Belt. Crafted from tough materials and featuring a secure clip closure, this accessory fuses urban edge with functionality. It will be the perfect addition to your streetwear look.", "/images/item_images/clip_belt.jpg"),
(565, 18, "Cara Skinny Scarf", 10, 25, "Product Code 4592167-02", "/images/item_images/cara_skinny_scarf.jpg"),
(566, 13, "Logo Combo Jogger", 2, 89, "Logo Combo Jogger is made of 70% cotton and 30% polyester", "/images/item_images/LOGO_COMBO_JOGGER.jpg"),
(567, 5, "Women Summer Shorts Green", 7, 42, " Green Summer Shorts great for a casual day out. The shorts feature a high waist and a relaxed fit, making them perfect for everyday wear. The shorts are made from a soft and comfortable fabric that is perfect for hot weather.", "/images/item_images/women_summer_shorts_green.jpg"),
(568, 17, "Baggy Jeans", 2, 75, "5-pocket jeans in rigid cotton denim. Rounded leg and a baggy fit from the seat to the hem with plenty of room around the whole leg. Dropped crotch and stacked at the ankle. Regular waist and a zip fly. It's denim perfection. Article number 1130309008 Length Long Waist Rise Regular waist Fit Loose fit Description Denim red, Solid colour", "/images/item_images/Baggy_Jeans.jpg"),
(569, 11, "Golden Silver Pearl Neckace", 10, 52, " A timeless and elegant piece of jewelry, the Golden Silver Pearl Necklace is sure to become a cherished heirloom. The necklace features a strand of lustrous pearls that are carefully strung on a delicate chain of gold and silver. The combination of warm and cool tones creates a stunning contrast that is sure to complement any complexion. The necklace is perfect for adding a touch of sophistication to any outfit, whether it is a formal gown or a casual ensemble.", "/images/item_images/golden_silver_pearl_neckace.jpg"),
(570, 13, "Raeburn Relaxed Fleece Pant", 2, 169, "- Vans x RAEBURN collection - 100% recycled polyester - High-pile fleece fabrication - Front slant zippered pockets - Ribbed cuffs and waist - Branded drawcord - Contrast fabric double knee and seat - Fit type Relaxed - Relaxed through the hip, thigh, and leg with a regular rise MATERIAL 100% Polyester", "/images/item_images/RAEBURN_RELAXED_FLEECE_PANT.jpg"),
(571, 14, "Adicolor Classics Waist Cinch Tee Black", 6, 69, "A SOFT, COMFORTABLE TEE THAT PLAYS WITH VOLUME. When you want something that checks all the boxes (though when don't you?), you have this adidas t-shirt. It's simple and casual, absolutely, but it also has the subtle details that make all the difference. Like the loose shape, which then gets cinched around the waist to emphasise the volume further. Or there's the cap sleeves, or the flash of 3-Stripes on the sleeves or … we could go on. Our cotton products support more sustainable cotton farming.", "/images/item_images/Adicolor_Classics_Waist_Cinch_Tee_Black.jpg"),
(572, 17, "4-Pack Finger Tip Rings", 10, 12, "Finger tip rings in metal with a lace-like look. Article number 1210198001 Weight 14 g Pieces/Pairs 4 Description Black, Solid colour", "/images/item_images/4-pack_finger_tip_rings.jpg"),
(573, 19, "Heattech Crew Neck Long Sleeve T-Shirt", 1, 15, "Recommended for 5°C to 20°C*. High-performance innerwear that is warm and easy to move around in. The shorter sleeve length stays hidden under outerwear.", "/images/item_images/HEATTECH_Crew_Neck_Long_Sleeve_T-Shirt.jpg"),
(574, 17, "Oversized Fit Cotton Hoodie", 5, 65, "Oversized hoodie in cotton sweatshirt fabric with a double-layered, drawstring hood, kangaroo pocket, low dropped shoulders, long sleeves and ribbing at the cuffs and hem. Article number 1035203008 Length Regular length Sleeve Length Long sleeve Fit Oversized Style Hoodie Description Black, Solid colour Concept BASICS", "/images/item_images/Oversized_Fit_Cotton_hoodie.jpg"),
(575, 10, "Blue Leather Running Shoe", 3, 64, " Blue leather running shoes are a stylish and comfortable option for men who want a shoe that can keep up with their active lifestyle. They are perfect for running, walking, hiking, and other outdoor activities.", "/images/item_images/blue_leather_running_shoe.jpg"),
(576, 18, "Tapered Skinny Chino", 2, 70, "Tapered Green Skinny Chino for Men", "/images/item_images/Tapered_Skinny_Chino.jpg"),
(577, 17, "4-Pack Mini Scrunchies", 10, 8, "Elasticated, fabric-covered mini scrunchies. Article number 1200988001 Weight 16 g Pieces/Pairs 4 Accessory Style Shoulder bag Description Black, Solid colour Concept DIVIDED", "/images/item_images/4-pack_mini_scrunchies.jpg"),
(578, 18, "Super Skinny Jean", 2, 69, "Super skinny, super reliable. The Super Skinny Jean is the tried-and-true jean made from really comfy stretch denim – perfect for day-in, day-out wear. You're a guy on the go, so we've thought ahead – they've got 5 pockets for all your things. Huge.", "/images/item_images/super_skinny_jean.jpg"),
(579, 15, "Women'S Oversized Asymmetrical Hoodie", 11, 169, "Can you believe it's already been 10 years of Tech Fleece? We're celebrating the occasion with a modern silhouette and a colour palette inspired by natural minerals. Since 2013, our premium, lightweight fleece is smooth both inside and out—giving you plenty of warmth without unnecessary bulk. Complete your look with matching joggers or your favourite pair of leggings.", "/images/item_images/Women's_Oversized_Asymmetrical_Hoodie.jpg"),
(580, 17, "Stand-Up Collar Dress", 8, 55, "Short dress in woven fabric with a stand-up collar and an opening with covered buttons at the back of the neck. Gently dropped shoulders and long balloon sleeves with a slit and covered button at the cuffs. Fitted skirt with a concealed zip at the back. Lined with a stappy top. Article number 1205567001 Length Short Sleeve Length Long sleeve Fit Regular fit Collar Stand-up collar Sleeve Style Balloon sleeve Description Black, Solid colour Concept MODERN CLASSIC", "/images/item_images/Stand-up_collar_dress.jpg");
