INSERT INTO ItemRatings (rating_id, customer_id, item_id, rating_value, review_text) VALUES
(7, 2, 139, 4, "I purchased the Teddy Jacket from H&M, and I must say it's a stylish choice. The soft teddy fabric, stand-up collar, and loose fit provide a comfortable and fashionable look. The light beige color adds a versatile touch to my wardrobe. Overall, a great addition for everyday fashion."),
(8, 2, 329, 5, "I absolutely love the Shein Mod Solid Ruffle Hem Cami Dress from SHEIN. The white boho style with contrast lace, tiered layer, and ruffle hem gives a chic and trendy vibe. The lace-up neckline adds a playful touch, and the high waist enhances the overall silhouette. A perfect choice for a stylish and comfortable outfit."),
(9, 2, 156, 5, "Adidas nailed it with the Blue Version Chile Wide Leg Pants. The wide-leg silhouette is both on-trend and comfortable. The front seams add a tailored touch, and the use of 100% recycled materials aligns with sustainable fashion. These pants offer a clean drape and flowy fit, making them a high-fashion and eco-friendly choice."),
(10, 2, 411, 3, "The Flat Over-The-Knee Boots from Zara are stylish but fell short of my expectations. While the over-the-knee design and buckle detail are appealing, the flat sole lacks the comfort I was hoping for. It's a decent choice for a specific look, but not the best for extended wear."),
(11, 2, 415, 5, "Zara's Zw Collection Off-The-Shoulder Lace Dress is a stunning piece. The long off-the-shoulder design with lace detailing and flared hem creates an elegant and romantic look. The dress is perfect for special occasions and makes a bold fashion statement with its timeless lace design."),
(12, 2, 280, 5, "The Nike Faux Fur Tote (10L) is a stylish and practical accessory. The big Swoosh logo adds a touch of flair, and the adjustable shoulder strap provides convenience. The tote's press-stud closure ensures quick access to essentials, making it a great choice for a day out on the town."),
(13, 2, 217, 4, "VANS' Knu Stack Leather shoes are a unique and fashionable choice. The leather material adds a touch of sophistication, and the design stands out. While they are stylish, they may not be the most comfortable for extended wear. Overall, a good addition to a trendy wardrobe."),
(14, 2, 342, 2, "The Curved Jeans from Uniqlo disappointed me. The curved outline may create a flattering silhouette, but the overall design lacks the comfort I expected. The classic 5-pocket design is not enough to compensate for the discomfort. Not my first choice for everyday wear."),
(15, 2, 569, 4, "The Golden Silver Pearl Necklace from Unique Styles is a timeless and elegant piece. The combination of gold and silver tones with lustrous pearls creates a stunning contrast. This necklace is perfect for adding a touch of sophistication to any outfit, making it a cherished accessory in my collection."),
(16, 3, 480, 5, "Nike's Jordan Stadium 90 is a game-changer. Evolving the game with elements from the AJ1 and AJ5, this sneaker offers a unique and comfortable design. The emphasis on comfort, durability, and stability makes it a new classic in my collection. A must-have for sneaker enthusiasts."),
(17, 3, 60, 2, "The Rubi shoes Harlow High Top from Cotton On fell short of expectations. While aiming for a classic finish, the design lacks the quality and comfort I anticipated. Not the best choice for those seeking a durable and comfortable high-top shoe."),
(18, 3, 417, 4, "Dress to Impress delivers with the White Floral Dress. This versatile and effortlessly chic dress is perfect for any occasion. The flattering silhouette, delicate floral print, and timeless white color make it a go-to choice for events that require a touch of femininity and romance."),
(19, 3, 517, 1, "The Leather Biker Jacket from H&M's Studio Collection disappointed me. Despite its edgy appearance, the short-cut, fitted silhouette, and crinkled finish didn't meet my expectations. The midnight black color and traditional biker style couldn't compensate for the lack of comfort and quality."),
(20, 3, 47, 4, "H&M's Crinkled Shirt is a stylish choice for everyday fashion. The crinkled weave, collar, and button-down front give it a trendy look. The longer back and striped design add flair. A versatile piece that can be dressed up or down, making it a valuable addition to my wardrobe."),
(21, 3, 440, 5, "The Nike Heritage Backpack is a must-have for on-the-go individuals. The spacious main compartment easily accommodates a 15' laptop, ensuring your essentials are always within reach. With 2 zipped accessories pockets for organization and a commitment to sustainability with at least 65% recycled polyester fibers, this backpack blends style and functionality seamlessly."),
(22, 3, 218, 5, "That Fashion Store's Gotop Watch With Mesh Band is a stunning timepiece. The sleek and minimalist design, coupled with a comfortable mesh band, makes it a perfect accessory for any woman. Powered by precise quartz movement and water-resistant up to 30 meters, this watch effortlessly combines style and functionality."),
(23, 3, 20, 4, "Adidas' Bucket Hat in Blue brings a classic style with a modern twist. The luxe, textured corduroy adds a touch of sophistication, making it casually cool and effortlessly confident. The rich and colorful print makes an instant statement, making it a versatile addition to any outfit."),
(24, 3, 255, 5, "The Nike Sportswear Essentials Women's Ribbed Cropped Tank Top is a wardrobe staple. The body-skimming tank top, crafted from stretchy, ribbed fabric, provides comfort around the clock. With a cropped fit near the waist, it's a versatile piece suitable for year-round wear."),
(25, 3, 105, 4, "Trendsetter's Gold Chain Necklace is a classic and versatile jewelry piece. Crafted from high-quality gold, the sleek and elegant design can be dressed up or down for any occasion. A must-have accessory that adds a touch of sophistication to any outfit."),
(26, 3, 423, 2, "My Style, My Way's Fine Gray Oversized Parka Winter Jacket disappointed me. While it boasts a sophisticated design with a faux fur-lined hood and fine gray color, the oversized silhouette sacrifices style for comfort. Not the elegant winter jacket I was hoping for."),
(27, 3, 100, 1, "Nike's Women's Corduroy Chicago Trousers missed the mark for me. Despite the utility-focused design with multiple pockets and an adjustable waistband, the heavyweight velvet corduroy fabric feels impractical and lacks the expected comfort. Not my preferred choice for everyday wear."),
(28, 3, 393, 2, "Adidas' Stan Smith Shoes in Grey, made in part with recycled materials, disappointed me. While the iconic design elements are present, the quilted tongue and soft synthetic leather upper compromise the flexible fit. The recycled content is a plus, but overall, the shoes fall short of expectations."),
(29, 3, 50, 4, "H&M's Rhinestone-Embellished Denim Jacket from the Studio Collection is a glamorous addition. Fully adorned with super-sparkly rhinestones, it creates a bold and eye-catching look. The oversized fit, cropped cut, and extended shoulders contribute to a fashionable, winged silhouette."),
(30, 3, 473, 3, "Trendsetter's Simple Pink Chic Woolen Jacket offers a timeless and elegant style. The clean and minimalist design with a relaxed fit, button-front closure, and soft woolen fabric provides warmth and comfort. The delicate pink hue adds femininity, but the overall look falls short of my expectations."),
(31, 3, 84, 4, "Forever 21's Dolman Cap-Sleeve Tee is a versatile knit tee. Featuring dolman cap sleeves and a relaxed fit, it's a comfortable and stylish addition to any wardrobe. The included necklace adds a touch of flair, making it suitable for various occasions."),
(32, 3, 579, 1, "Nike's Women's Oversized Asymmetrical Hoodie, celebrating 10 years of Tech Fleece, disappoints. While the modern silhouette and mineral-inspired color palette sound promising, the premium fleece feels bulkier than expected. Not the sleek and lightweight design I was hoping for."),
(33, 4, 554, 4, "Uniqlo's Dry Stretch Sweat Long Sleeve Full-Zip Hoodie, updated with a matte texture, offers both style and comfort. The stretchy fabric makes it a versatile choice for wearing on its own or as an inner layer. A great addition to casual outfits."),
(34, 4, 518, 5, "Zara's Technical Training Cap made of lightweight, stretchy technical fabric is a winner. The printed logo adds a touch of style, making it a fashionable accessory. Comfortable and on-trend, this cap is perfect for completing a sporty and casual look."),
(35, 4, 467, 4, "Dress to Impress' Cream Hooded Puffer Coat is a stylish and functional winter jacket. Made from high-quality materials, it features a classic puffer design with a cream-colored finish. The water-resistant finish, removable hood, and multiple pockets make it ideal for everyday wear."),
(36, 4, 288, 5, "Adidas' Essentials Made With Nature Tee combines timeless style with environmental consciousness. The allover print, small pops of color, and iconic Trefoil logo on soft organic cotton make it a comfortable and edgy choice. A step towards sustainability in casual outfits."),
(37, 4, 365, 4, "Fashionista's Green Autumn Casual Hooded Jacket is a perfect blend of warmth and style. Made from high-quality materials, the classic hooded design in a green-colored finish adds a touch of sophistication. The water-resistant finish, multiple pockets, and drawcord hem make it practical for everyday wear."),
(38, 4, 403, 5, "Beauty Haven's Regular Straight Fit Jeans are a classic and versatile pair. The straight leg, relaxed fit, and regular rise provide a flattering and comfortable silhouette. Whether dressed up or down, these jeans are a wardrobe essential for any occasion."),
(39, 4, 358, 4, "Zara's Jacket With Removable Hood is a practical and stylish puffer jacket. Featuring a high neck with a detachable hood, long sleeves with elasticated cuffs, and multiple pockets, it combines functionality with fashion. The button-up front hidden by a placket adds a sleek touch."),
(40, 4, 361, 4, "H&M's T-Shirt Long Fit is a versatile and comfortable wardrobe staple. The long, round-necked design in soft jersey with a curved hem adds a modern touch. Perfect for casual wear, this t-shirt in solid white is a timeless addition to any collection."),
(41, 4, 251, 4, "VANS' Rowan Zorilla Long Sleeve T-Shirt is a classic and comfortable choice. The 100% cotton fabric in a 20/1 knit provides a soft and breathable feel. A timeless addition to casual wear, this long sleeve tee is a must-have for those seeking comfort and style."),
(42, 4, 370, 4, "Uniqlo's Airism Cotton Crew Neck T-Shirt offers comfort with a look of cotton. The smooth 'AIRism' fabric, great for wearing on its own or as an inner layer, provides a comfortable fit. A versatile addition to casual outfits, combining style and functionality."),
(43, 4, 290, 5, "Nike's Court Vision Low Next Nature Men's Shoes are a classic remixed with modern sustainability. With at least 20% recycled materials, the crisp upper, stitched overlays, and plush, low-cut collar deliver both style and comfort. A perfect blend of '80s basketball aesthetics and contemporary design."),
(44, 4, 426, 5, "Nike's Vomero 5 Men's Shoes bring early-2000s running to modern heights. The combination of breathable and durable materials, along with Zoom Air cushioning, ensures a smooth ride. A stylish and functional choice for those seeking comfort and performance in their everyday footwear."),
(45, 4, 405, 4, "VANS' Skate Era, part of the All New Skate Classics collection, is built extra tough for skateboarding. Redesigned for modern skateboarding, it features DURACAP reinforced underlays, a new two-part foxing tape, and SICKSTICK rubber compound for enhanced grip and boardfeel. A stylish choice for skateboarders seeking both durability and iconic design."),
(46, 4, 254, 4, "The Textured Sweater With Rips from Zara is a stylish choice for those looking to stay cozy with a touch of edginess. The round neck, long sleeves, and ripped-effect texture add a fashionable flair. The ribbed trims complete the look, making it a versatile sweater for various occasions."),
(47, 4, 568, 1, "H&M's Baggy Jeans failed to meet my expectations. The rigid cotton denim and rounded leg create an unflattering silhouette. The dropped crotch and stacked ankles add an awkward element to the fit. Despite the denim perfection claim, these jeans miss the mark for both style and comfort."),
(48, 4, 304, 4, "H&M's Straight Regular Jeans offer a comfortable and stylish option for denim enthusiasts. The slight stretch in the cotton denim provides good comfort, while the straight leg and regular fit deliver a classic silhouette. With durability in mind, this is denim that lasts."),
(49, 4, 177, 4, "Adidas' X Plrboost Shoes in Blue are a stylish and eco-friendly choice. The BOOST midsole ensures responsiveness and ultimate comfort with each step. The soft upper, made with at least 50% recycled content, adds a sustainable touch. These sneakers effortlessly blend style and energy."),
(50, 4, 355, 1, "H&M's Relaxed Fit Hoodie disappoints with its sweatshirt fabric and bulky design. The lined drawstring hood, kangaroo pocket, and dropped shoulders contribute to an unflattering fit. The Bulbasaur Pokémon design adds a quirky element but doesn't redeem the overall lack of style and comfort."),
(51, 4, 278, 5, "Trendsetter's Black Non-Slip Meshed Running Shoe is a stellar choice for active men. Combining style and comfort, these shoes are perfect for running, walking, hiking, and more. The non-slip meshed design adds both functionality and a sleek aesthetic to your active lifestyle."),
(52, 5, 286, 4, "Zara's Leather Trousers are a bold fashion statement. The straight-leg design, made of leather, and the classic five-pocket style add a touch of edginess. The front zip fly and button fastening complete the look, making these trousers a versatile addition to your wardrobe."),
(53, 5, 190, 4, "H&M's Oversized Fit Wool-Blend Overshirt is a cozy and stylish addition to your wardrobe. The shaggy wool blend knit, collar, and button-down front create a relaxed and fashionable look. With long sleeves, buttoned cuffs, and open chest pockets, this overshirt offers both warmth and style."),
(54, 5, 409, 5, "Forever 21's Rayon Abstract Striped Shirt is a standout piece. The woven rayon material, allover abstract striped pattern, and button-front closures add a touch of sophistication. The short sleeves and Cuban collar make it a perfect choice for a stylish and relaxed look."),
(55, 5, 289, 5, "Adidas' Train Icons 3-Stripes Training Pants in Blue offer a winning combination of stretch, moisture management, and recycled materials. The AEROREADY technology keeps you dry during workouts, and the mid-rise fit with tapered legs ensures distraction-free movement. A sustainable choice for fitness enthusiasts."),
(56, 5, 396, 2, "Adidas' Pureboost 23 Shoes in Grey fall short of expectations. Despite the energy-returning features and recycled materials, the running shoes lack the expected comfort. The lightweight engineered mesh upper doesn't provide the desired support, making these shoes a disappointment in terms of performance and style."),
(57, 5, 216, 4, "VANS' Checkerboard Society Short Sleeve Tee is a classic crewneck tee with a stylish twist. Made from heavier weight cotton, it features a printed Vans logo graphic on the front and back. A versatile and trendy choice for casual wear."),
(58, 5, 53, 2, "Adidas' Own The Run Long Sleeve Tee in Blue fails to impress. Despite the recycled materials and long sleeve coverage, the comfort falls short. The thumbholes don't hold the sleeves comfortably, and the AEROREADY moisture absorption feels subpar. Not the ideal running tee I was hoping for."),
(59, 5, 129, 5, "Nike's Windrunner Men's Repel Running Jacket is a top-notch choice for rainy days. The super-lightweight design repels water, keeping you dry. The UV-blocking fabric provides additional protection, and the jacket's packable nature and breathability make it a versatile option for any run."),
(60, 5, 529, 5, "Uniqlo's Sweat Turtleneck Long Sleeve Shirt offers a versatile and relaxed fit. The sweat material, brushed on the inside, provides warmth and comfort. A perfect addition to your wardrobe for a laid-back yet stylish look."),
(61, 5, 551, 4, "Cotton On's Urban Jogger exudes urban vibes with its drop crotch style and enzyme wash for a worn-out vintage look. The attention to detail adds flair without compromising comfort. Pair it with a crew neck for a complete, on-trend ensemble."),
(62, 5, 88, 4, "Adidas' 4Dfwd 3 Running Shoes in Grey provide a smooth ride and innovative design. The 3D-printed adidas 4D midsole, combined with a Continental™ Rubber outsole, delivers extraordinary traction. The adaptive PRIMEKNIT and breathable mesh keep your feet comfortable for kilometre after kilometre."),
(63, 5, 522, 4, "VANS' Authentic Chino Loose Pant is a versatile chino pant that delivers both style and functionality. With classic chino front hand pockets, rear welt pockets, and embroidered Drop V bartacks, this skate essential combines Off The Wall style with comfort for the perfect skateboarding experience."),
(64, 5, 144, 4, "Uniqlo's Heattech Pile Lined Sweat Full-Zip Hoodie is a warm and stylish choice. The 'HEATTECH' on the outside, soft pile lining on the inside, and a sleek one-piece fabric cut make it both functional and fashionable."),
(65, 5, 453, 4, "Cotton On's Trucker Hat is a summer essential. With an adjustable snapback and a variety of colors and fabric types, it's the perfect companion for backyard gatherings or beach time."),
(66, 6, 576, 4, "Cotton On's Tapered Skinny Chino in Green is a stylish and comfortable choice. The tapered fit adds a modern touch, making it suitable for various occasions."),
(67, 6, 78, 3, "Uniqlo's Sweatshirt with sporty side stripes and raglan sleeves allows for easy movement. While it adds a touch of athleticism, the overall design lacks the wow factor, providing a standard sweatshirt option."),
(68, 6, 535, 4, "The Style Collective's Green Cotton V Neck Shirt is a stylish addition to your wardrobe. The soft and breathable cotton fabric, combined with the V-neckline, adds sophistication. Perfect for both casual and dressed-up occasions."),
(69, 6, 8, 5, "H&M's Walking Boots are a durable and stylish choice for harsh weather conditions. With water-repellent material, ankle-height shaft, and chunky soles, these boots provide both functionality and a fashionable edge."),
(70, 6, 311, 5, "Cotton On's Linen Pant reigns supreme in versatility and comfort. Made from 100% French Linen, it's a go-to option for those who prioritize both style and ease."),
(71, 6, 355, 4, "H&M's Relaxed Fit Hoodie, with a soft brushed inside, offers a comfortable and laid-back style. The lined drawstring hood, kangaroo pocket, and ribbing at the cuffs and hem make it a relaxed fit for various occasions."),
(72, 6, 208, 4, "H&M's Regular Fit Poplin Shirt is a classic choice for a polished look. The cotton poplin, turn-down collar, and French front create a sophisticated appearance. Perfect for various occasions, it's a staple in every wardrobe."),
(73, 7, 256, 5, "Adidas' Adicolor Essentials Tights offer casual leggings for everyday styling. The perfect stretch wraps your legs in comfort, providing versatility in how you wear them. A must-have for any wardrobe."),
(74, 7, 178, 4, "My Style, My Way's Plaid Jacket Coat For Spring is a versatile and stylish choice for the transition to spring. The relaxed fit, long sleeves, and button-front closure make it suitable for layering over various outfits."),
(75, 7, 180, 4, "H&M's Beaded Trousers are a unique and stylish addition to your wardrobe. The airy viscose weave, high waist with elasticated smocking, and wide, flared hems with beads create a distinctive and fashionable look."),
(76, 7, 9, 4, "I recently purchased the 'Frilled Tulle To' from H&M, and I must say, it exceeded my expectations. The elegant sleeveless top with a frilled collar is a perfect addition to my wardrobe. The pleated weave and delicate lash-stitch edges add a touch of sophistication. The concealed zip and hook-and-eye fastener at the back provide a seamless finish. Overall, a stylish and well-crafted piece from H&M's Studio Collection."),
(77, 7, 226, 5, "I'm thrilled with my purchase of the 'Sidestripe Classic Slip-On 138' from VANS. The textile material is not only comfortable but also gives a classic yet stylish vibe. The sidestripe detail adds a unique touch, making these slip-ons a standout choice. A perfect blend of comfort and fashion."),
(78, 7, 253, 4, "I recently got the 'Women'S High-Waisted Wide-Leg Tracksuit Bottoms' from Nike, and I'm loving the transformation they bring to my fleece wardrobe. The extra-long wide leg and hem vents allow me to showcase my favorite shoes. The ribbing at the waist and exaggerated drawcord add a stylish flair. A cozy and fashionable choice for a casual day out."),
(79, 7, 303, 5, "I'm impressed with the 'Shein Petite Flap Pocket Side Cargo Pants' from SHEIN. The light grey color and casual style make them a versatile addition to my wardrobe. The drawstring and elastic waist provide a comfortable fit, and the cargo pocket details add a trendy touch. A must-have for a laid-back yet chic look."),
